INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(1, 8, NULL, 'آموزش ساخت یک Bundle در فریمورک symfon', '<style type="text/css">.code{\r\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white\r\n}\r\n</style>\r\n<p dir="rtl"><strong>آموزش ساخت یک Bundle در فریمورک symfony</strong></p>\r\n\r\n<p dir="rtl">در این آموزش قصد داریم روش ساخت یک باندل در فریمورک سیمفونی را توضیح دهیم :</p>\r\n\r\n<p dir="rtl">ابتدا با ترمینال لینوکس یا کامند ویندوز وارد پوشه ای که فریمورک قرار دارد وارد می شویم&nbsp;</p>\r\n\r\n<div class="code">\r\n<p>//linux</p>\r\n\r\n<p>cd /var/www/html/symfony</p>\r\n\r\n<p>//windows</p>\r\n\r\n<p>cd C:\\xampp\\htdocs\\symfony</p>\r\n</div>\r\n\r\n<p dir="rtl">سپس دستور زیر را برای ساخت یک بندل وارد می کنیم :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class="code">//version 3\r\n<p>php bin/console generate:bundle&nbsp;</p>\r\n\r\n<p>// version &lt; 3</p>\r\n\r\n<p>php app/console generate:bundle</p>\r\n</div>\r\n\r\n<p dir="rtl">&nbsp;بعد مقدارهای خواسته شده را پر می کنیم :</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class="code">Are you planning on sharing this bundle across multiple applications? [no]: &nbsp;</div>\r\n\r\n<p dir="rtl">&nbsp;اگر خواستیم این باندل از تمام اپلیکیشن ها قابل دسترسی باشد مقدار yes را وارد می کنیم در غیر اینصورت اینتر را می زنیم :</p>\r\n\r\n<p dir="rtl">&nbsp;</p>\r\n\r\n<div class="code">Give your bundle a descriptive name, like BlogBundle.<br />\r\nBundle name:&nbsp;</div>\r\n\r\n<p dir="rtl">&nbsp;نام باندل موزد نظر را در این قسمت وارد می کنیم به عنوان مثال : TestBundle دقت کنید حروف Bundle را بعد از نام وارد کنید</p>\r\n\r\n<p dir="rtl">&nbsp;</p>\r\n\r\n<div class="code">\r\n<p>Bundles are usually generated into the src/ directory. Unless you''re<br />\r\ndoing something custom, hit enter to keep this default!</p>\r\n\r\n<p>Target Directory [src/]:&nbsp;</p>\r\n</div>\r\n\r\n<p dir="rtl">&nbsp;در این قسمت نام دایرکتوری مورد نظر را وارد می کنید به طور پیشفرض داخل پوشه src قرار میگیرد اینتر را زده تا وارد مرحله بعد شوید</p>\r\n\r\n<p dir="rtl">&nbsp;</p>\r\n\r\n<div class="code">\r\n<p>What format do you want to use for your generated configuration?</p>\r\n\r\n<p>Configuration format (annotation, yml, xml, php) [annotation]:&nbsp;</p>\r\n</div>\r\n\r\n<p dir="rtl">&nbsp;در این قسمت موتور کدهای خود را وارد می کنید به طور پیشفرض annotation می باشد اینتر را بزنید</p>\r\n\r\n<p dir="rtl">&nbsp;</p>\r\n\r\n<div class="code">\r\n<p>&gt; Generating a sample bundle skeleton into src/TestBundle OK!<br />\r\n&gt; Checking that the bundle is autoloaded: OK<br />\r\n&gt; Enabling the bundle inside app/AppKernel.php: OK<br />\r\n&gt; Importing the bundle''s routes from the app/config/routing.yml file: OK<br />\r\n&gt; Importing the bundle''s services.yml from the app/config/config.yml file: OK</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\r\n&nbsp; Everything is OK! Now get to work :). &nbsp;</p>\r\n</div>\r\n\r\n<p dir="rtl">اگر تمامی قسمت ها به درستی وارد شود این قسمت را مشاهده خواهید کرد و Bundle مورد نظر در پوشه src قرار گرفته است .</p>\r\n\r\n<p dir="rtl">موفق باشد ...</p>\r\n\r\n<p dir="rtl">&nbsp;</p>\r\n', 0, 20, '2016-07-01 00:00:00', NULL, NULL, 0, 0);
INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(9, 8, NULL, 'آموزش ساخت یک Bundle در فریمورک سیمفونی', '<p>&lt;style type="text/css"&gt;.code{<br />\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white<br />\n}<br />\n&lt;/style&gt;<br />\n&lt;p dir="rtl"&gt;&lt;strong&gt;آموزش ساخت یک Bundle در فریمورک symfony&lt;/strong&gt;&lt;/p&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;در این آموزش قصد داریم روش ساخت یک باندل در فریمورک سیمفونی را توضیح دهیم :&lt;/p&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;ابتدا با ترمینال لینوکس یا کامند ویندوز وارد پوشه ای که فریمورک قرار دارد وارد می شویم&amp;nbsp;&lt;/p&gt;</p>\n\n<p>&lt;div class="code"&gt;<br />\n&lt;p&gt;//linux&lt;/p&gt;</p>\n\n<p>&lt;p&gt;cd /var/www/html/symfony&lt;/p&gt;</p>\n\n<p>&lt;p&gt;//windows&lt;/p&gt;</p>\n\n<p>&lt;p&gt;cd C:\\xampp\\htdocs\\symfony&lt;/p&gt;<br />\n&lt;/div&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;سپس دستور زیر را برای ساخت یک بندل وارد می کنیم :&lt;/p&gt;</p>\n\n<p>&lt;p&gt;&amp;nbsp;&lt;/p&gt;</p>\n\n<p>&lt;div class="code"&gt;//version 3<br />\n&lt;p&gt;php bin/console generate:bundle&amp;nbsp;&lt;/p&gt;</p>\n\n<p>&lt;p&gt;// version &amp;lt; 3&lt;/p&gt;</p>\n\n<p>&lt;p&gt;php app/console generate:bundle&lt;/p&gt;<br />\n&lt;/div&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;بعد مقدارهای خواسته شده را پر می کنیم :&lt;/p&gt;</p>\n\n<p>&lt;p&gt;&amp;nbsp;&lt;/p&gt;</p>\n\n<p>&lt;div class="code"&gt;Are you planning on sharing this bundle across multiple applications? [no]: &amp;nbsp;&lt;/div&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;اگر خواستیم این باندل از تمام اپلیکیشن ها قابل دسترسی باشد مقدار yes را وارد می کنیم در غیر اینصورت اینتر را می زنیم :&lt;/p&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;&lt;/p&gt;</p>\n\n<p>&lt;div class="code"&gt;Give your bundle a descriptive name, like BlogBundle.&lt;br /&gt;<br />\nBundle name:&amp;nbsp;&lt;/div&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;نام باندل موزد نظر را در این قسمت وارد می کنیم به عنوان مثال : TestBundle دقت کنید حروف Bundle را بعد از نام وارد کنید&lt;/p&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;&lt;/p&gt;</p>\n\n<p>&lt;div class="code"&gt;<br />\n&lt;p&gt;Bundles are usually generated into the src/ directory. Unless you''re&lt;br /&gt;<br />\ndoing something custom, hit enter to keep this default!&lt;/p&gt;</p>\n\n<p>&lt;p&gt;Target Directory [src/]:&amp;nbsp;&lt;/p&gt;<br />\n&lt;/div&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;در این قسمت نام دایرکتوری مورد نظر را وارد می کنید به طور پیشفرض داخل پوشه src قرار میگیرد اینتر را زده تا وارد مرحله بعد شوید&lt;/p&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;&lt;/p&gt;</p>\n\n<p>&lt;div class="code"&gt;<br />\n&lt;p&gt;What format do you want to use for your generated configuration?&lt;/p&gt;</p>\n\n<p>&lt;p&gt;Configuration format (annotation, yml, xml, php) [annotation]:&amp;nbsp;&lt;/p&gt;<br />\n&lt;/div&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;در این قسمت موتور کدهای خود را وارد می کنید به طور پیشفرض annotation می باشد اینتر را بزنید&lt;/p&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;&lt;/p&gt;</p>\n\n<p>&lt;div class="code"&gt;<br />\n&lt;p&gt;&amp;gt; Generating a sample bundle skeleton into src/TestBundle OK!&lt;br /&gt;<br />\n&amp;gt; Checking that the bundle is autoloaded: OK&lt;br /&gt;<br />\n&amp;gt; Enabling the bundle inside app/AppKernel.php: OK&lt;br /&gt;<br />\n&amp;gt; Importing the bundle''s routes from the app/config/routing.yml file: OK&lt;br /&gt;<br />\n&amp;gt; Importing the bundle''s services.yml from the app/config/config.yml file: OK&lt;/p&gt;</p>\n\n<p>&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;br /&gt;<br />\n&amp;nbsp; Everything is OK! Now get to work :). &amp;nbsp;&lt;/p&gt;<br />\n&lt;/div&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;اگر تمامی قسمت ها به درستی وارد شود این قسمت را مشاهده خواهید کرد و Bundle مورد نظر در پوشه src قرار گرفته است .&lt;/p&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;موفق باشد ...&lt;/p&gt;</p>\n\n<p>&lt;p dir="rtl"&gt;&amp;nbsp;&lt;/p&gt;<br />\n&nbsp;</p>\n', 32, 7, '2016-07-19 19:21:46', NULL, 'data:image/jpeg;base64,', 1, 1);
INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(10, 8, NULL, 'کتابخانه استاندارد php', '<p dir="rtl"><strong>کتابخانه استاندارد php&nbsp;</strong></p>\n\n<p dir="rtl">کتابخانه استاندارد php مجموعه ای از توابع کلاسها و اینترفیس ها می باشد که برای حل مشکلات و آسان تر شدن کارها طراحی شده است.به عنوان مثال&nbsp;برای استک ها و صف ها و ... &nbsp;.</p>\n\n<p dir="rtl">شما می توانید اطلاعات کامل در رابطه با کتابخانه استاندارد php را در <a href="http://php.net/manual/en/book.spl.php">اینجا</a>&nbsp;پیدا کنید یا می توانید درون همین سایت آموزش کامل کتابخانه استاندارد php را دنبال کنید</p>\n', 24, 4, '2016-07-21 08:59:47', NULL, 'data:image/jpeg;base64,', 2, 0);
INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(11, 9, NULL, 'iterator ها در php', '<p dir="rtl">iterator ها مجموعه ای از کلاس ها و توابع برای کار با فایل ها و xmlها و سند های اکسل و ... می باشد که اطلاعات را به صورت آرایه و آبجکت بر می گرداند. این توابع کار شما را راحت و استفاده از آن ها برای شما بسیار مقرون به صرفه می باشد .&nbsp;</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<p dir="rtl">&nbsp;</p>\n', 237, 4, '2016-07-21 09:24:44', NULL, 'data:image/jpeg;base64,', 4, 0);
INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(12, 9, NULL, 'خواندن اطلاعات داخل یک پوشه با php', '<p dir="rtl">خواندن اطلاعات یک پوشه به وسیله کتابخانه استاندارد php و قرار دادن فیلتر بر روی آن ها</p>\n\n<p dir="rtl">به وسیله کد زیر اطلاعات یک پوشه را بدست می آوریم :</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">$dir = new FilesystemIterator("Your Path");</div>\n\n<div class="code">$dir = new FilesystemIterator("./img"); &nbsp;&nbsp;</div>\n\n<div class="code">foreach ($dir as $key =&gt; $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value."&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<div class="code" dir="rtl">OutPut</div>\n\n<div class="code">./img/pdf.jpg<br />\n./img/head_1.jpg</div>\n\n<p dir="rtl">&nbsp;می توانیم فایل هایی که می خواهیم به وسیله regex بدست آوریم :</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">&nbsp; $dir = new FilesystemIterator("./img");<br />\n&nbsp; $jpg = new RegexIterator($dir, "/\\.jpg/i");<br />\n&nbsp; &nbsp;foreach ($jpg as $key =&gt; $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;echo $value."&lt;br&gt;";<br />\n&nbsp; &nbsp;}//&nbsp;./img/pdf.jpg &nbsp;./img/head_1.jpg</div>\n\n<p dir="rtl">به وسیله کد بالا فقط تصاویر را در با پسوند .jpg در خروجی نمایش داده می شود&nbsp;</p>\n\n<p dir="rtl">می توانیم offset و limit برای آرایه خو استفاده نماییم:</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">$dir = new FilesystemIterator("./img");<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $jpg = new RegexIterator($dir, "/\\.jpg/i");<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $limit = new LimitIterator($jpg,2,2);<br />\n&nbsp; &nbsp; &nbsp; &nbsp; foreach ($limit as $key =&gt; $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value."&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">کد بالا از خانه شماره ۲ به بعد تا ۲ خانه را بر میگرداند&nbsp;.</p>\n\n<p dir="rtl">موفق باشید ...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n</style>\n', 324, 2, '2016-07-21 10:12:47', '2016-07-21 13:20:40', 'data:image/jpeg;base64,', 3, 0);
INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(13, 9, NULL, 'خواندن یک دایرکتوری و فایل های آن با php', '<p dir="rtl">در این آموزش قصد داریم خواندن فایل ها و دایرکتوری های یک مسیر توسط &nbsp;php را آموزش دهیم :</p>\n\n<p dir="rtl">توسط دستور زیر اطلاعات یک دایرکتوری را می خوانیم :</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">$dir = new DirectoryIterator("Your Path");<br />\n&nbsp;$dir = new DirectoryIterator("./img");</div>\n\n<p dir="rtl">توسط یک حلقه می توانیم اطلاعات بدست آمده را در خروجی نمایش دهیم :&nbsp;</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; foreach ($dir as $key =&gt; $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value."&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; } // out put &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; barber.jpg<br />\nnetwork.jpg<br />\nR.pdf<br />\nFonts<br />\nheader.png<br />\nhead_1.jpg<br />\ncabinet.jpg<br />\nisi.jpg</div>\n\n<p dir="rtl">می توانیم از اطلاعات بدست آمده فقط فایل های آن را در خروجی نمایش دهیم :</p>\n\n<div class="code">$dir = new DirectoryIterator(".");<br />\n&nbsp; &nbsp; &nbsp; &nbsp; foreach ($dir as $key =&gt; $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; if($value-&gt;isFile()){<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $files[] = clone $value;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; echo ''&lt;pre&gt;'';<br />\n&nbsp; &nbsp; &nbsp; &nbsp; var_dump($files); // out put&nbsp;\n<pre>\n  [0]=&gt;\n  object(DirectoryIterator)#3 (4) {\n    ["pathName":"SplFileInfo":private]=&gt;\n    string(16) "./img/barber.jpg"\n    ["fileName":"SplFileInfo":private]=&gt;\n    string(10) "barber.jpg"\n    ["glob":"DirectoryIterator":private]=&gt;\n    bool(false)\n    ["subPathName":"RecursiveDirectoryIterator":private]=&gt;\n    string(0) ""\n  }\n  [1]=&gt;\n  object(DirectoryIterator)#4 (4) {\n    ["pathName":"SplFileInfo":private]=&gt;\n    string(17) "./img/network.jpg"\n    ["fileName":"SplFileInfo":private]=&gt;\n    string(11) "network.jpg"\n    ["glob":"DirectoryIterator":private]=&gt;\n    bool(false)\n    ["subPathName":"RecursiveDirectoryIterator":private]=&gt;\n    string(0) ""\n  }</pre>\n</div>\n\n<p dir="rtl">توسط یک حلقه اطلاعات بدست آمده را می توانید در خروجی نمایش دهید :</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">&nbsp; &nbsp; foreach ($files as $file) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $file-&gt;getFilename()."&lt;br&gt;";<br />\n&nbsp; &nbsp; }</div>\n\n<p dir="rtl">توابع پر کاربرد آن :</p>\n\n<div class="code">\n<p style="direction=ltr">$file-&gt;getSize(); // بدست آوردن سایز فایل</p>\n\n<p style="direction=ltr">$file-&gt;getExtension(); // بدست آوردن جنس فایل</p>\n\n<p style="direction=ltr">$file-&gt;getCTime(); // بدست آوردن زمان ایجاد فایل</p>\n</div>\n\n<p dir="rtl">موفق باشید ...&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 237, 4, '2016-07-21 10:42:02', '2016-07-21 13:15:19', 'data:image/jpeg;base64,', 3, 0);
INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(14, 9, NULL, 'خواندن تمام فایل ها و فولدرها و فایل های داخل فولدر در یک دایرکتوری با php', '<p dir="rtl">خواندن تمام فایل ها و فولدرها و فایل های آن با php</p>\n\n<p dir="rtl">ابتدا باید اطلاعات دایرکتوری را توسط دستور زیر بدست بیاوریم :</p>\n\n<div class="code">$dir = new RecursiveDirectoryIterator("."); // Your Path</div>\n\n<p dir="rtl">سپس با دستور زیر تمام فایل های آن را می خوانیم :</p>\n\n<div class="code">&nbsp; &nbsp;&nbsp;$dir = new RecursiveIteratorIterator($dir);<br />\n&nbsp; &nbsp; &nbsp; &nbsp; foreach ($dir as $key =&gt; $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value . "&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<div class="code">Out Put</div>\n\n<p dir="rtl">خروجی :&nbsp;</p>\n\n<div class="code">/var/www/html/app/controller/..<br />\n/var/www/html/app/controller/TestController.php<br />\n/var/www/html/app/controller/CacheController.php<br />\n/var/www/html/app/controller/.<br />\n/var/www/html/app/controller/HelloWorldController.php<br />\n/var/www/html/app/controller/DefaultController.php<br />\n/var/www/html/app/controller/HelloTestController.php</div>\n\n<p dir="rtl">می توان . و .. را از بین برد توسط دستور زیر:</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; $dir = new RecursiveDirectoryIterator($path);<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $dir-&gt;setFlags(FilesystemIterator::SKIP_DOTS | FilesystemIterator::UNIX_PATHS); // این دستور<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $dir = new RecursiveIteratorIterator($dir);<br />\n&nbsp; &nbsp; &nbsp; &nbsp; foreach ($dir as $key =&gt; $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value . "&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">دستورات پر کاربرد :</p>\n\n<div class="code">$value-&gt;getCTime(); // زمان ایجاد<br />\n$value-&gt;getExtension(); // پسوند<br />\n$value-&gt;getSize(); // اندازه<br />\n$value-&gt;getPath(); // آدرس<br />\n$value-&gt;getFilename(); // نام فایل</div>\n\n<p dir="rtl">جون این توابع به حالت بازگشتی تعریف شده اند می توان برای آن ها عمق و حالت های برگداندن اطلاعات را مشخص نمود :</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">$dir = new RecursiveDirectoryIterator(".");<br />\n$dir-&gt;setFlags(FilesystemIterator::SKIP_DOTS|FilesystemIterator::UNIX_PATHS);<br />\n$dir = new RecursiveIteratorIterator($dir , RecursiveIteratorIterator::SELF_FIRST);// تعیین کردن خود فولدر اول خروجی قرار بگیرد<br />\n$dir-&gt;setMaxDepth(1); // تعیین عمق<br />\n&nbsp; &nbsp;foreach ($dir as $key =&gt; $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;echo $value."&lt;br&gt;";<br />\n&nbsp; &nbsp;}</div>\n\n<p>&nbsp;</p>\n\n<p dir="rtl">موفق باشید ...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n<p>&nbsp;</p>\n', 5, 4, '2016-07-21 18:57:43', '2016-07-21 19:08:55', NULL, 0, 0),
(15, 9, NULL, 'خواندن فایل های متنی درون یک پوشه با php', '<p dir="rtl">خواندن فایل های متنی درون یک پوشه با php</p>\n\n<p dir="rtl">توسط دستور زیر اطلاعات درون یک پوشه را بدست می آوریم :</p>\n\n<div class="code">$dir = new FilesystemIterator("./txt"); Your Path</div>\n\n<p dir="rtl">بعد توسط دستور زیر فایل های با پسوند .txt را بدست می آوریم و اطلاعات درون آن را می خوانیم&nbsp;:</p>\n\n<div class="code">&nbsp;foreach ($dir as $file) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; if($file-&gt;getExtension() == "txt"){<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $text = $file-&gt;openFile();<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; foreach ($text as $line) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $line."&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">در دستورات بالا از کتابخانه استاندارد php استفاده شده است و به صورت پیشفرض درون کلاس های phpقرار دارد.</p>\n\n<p dir="rtl">توسط دستور زیر می توان به فایل های خوانده شده متن اضافه نمود :</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; foreach ($dir as $file) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; if($file-&gt;getExtension() == "txt"){<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $text = $file-&gt;openFile("r+");<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; foreach ($text as $line) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $line."&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $text-&gt;fwrite("This Line Added dynamicly");<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">موفق باشید ...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 5, 3, '2016-07-21 19:59:52', NULL, NULL, 0, 0);
INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(16, 9, NULL, 'خواندن فایل های csv با php', '<p dir="rtl">خواندن فایل های csv با php</p>\n\n<p dir="rtl">ابتدا توسط دستور زیر فایل مورد نظر را می خوانیم :</p>\n\n<div class="code">$dir = new SplFileObject("data/cars.csv");</div>\n\n<p dir="rtl">&nbsp;سپس تعیین می کنیم که فایل خوانده csv می باشد :</p>\n\n<div class="code">$dir-&gt;setFlags(SplFileObject::READ_CSV);</div>\n\n<p dir="rtl">اطلاعات خوانده شده توسط این دستور به صورت آبجکت باز می گردد که خانه اول آن نام هدر ها می باشد و بقیه خانه ها اطلاعات می باشد.</p>\n\n<p dir="rtl">حال می توانیم از اطلاعات استفاده نماییم :</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; &lt;?php<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $dir = new SplFileObject("data/cars.csv");<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $dir-&gt;setFlags(SplFileObject::READ_CSV);<br />\n&nbsp; &nbsp; &nbsp; &nbsp; foreach ($dir as $line) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $cars[] = $line; // &nbsp;اطلاعات خوانده شده را درون &nbsp;آرایه می ریزیم<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; ?&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;table class="table table-hover"&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;thead&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;?php foreach ($cars[0] as $head): ?&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;th&gt;&lt;?= $head ?&gt;&lt;/th&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;?php endforeach; ?&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/thead&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;tbody&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;?php foreach ($cars as $key =&gt; $data): ?&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;tr&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;?php<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; if ($key != 0)<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; foreach ($data as $head):<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ?&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;td&gt; &nbsp; &lt;?= $head ?&gt;&lt;/td&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;?php endforeach; ?&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;/tr&gt;<br />\n&lt;?php endforeach; ?&gt;<br />\n&nbsp; &nbsp; &lt;/tbody&gt;<br />\n&nbsp; &nbsp; &lt;tfoot&gt;<br />\n&nbsp; &nbsp; &lt;?php foreach ($cars[0] as $head): ?&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;th&gt;&lt;?= $head ?&gt;&lt;/th&gt;<br />\n&lt;?php endforeach; ?&gt;<br />\n&lt;/tfoot&gt;<br />\n&lt;/table&gt;</div>\n\n<p dir="rtl">خروجی :</p>\n\n<p dir="rtl"><img alt="" border="0" src="data:image/png;base64," style="width:100%" vspace="0" width="100%" /></p>\n\n<p dir="rtl">موفق باشید ...</p>\n\n<p dir="rtl">\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n</p>\n', 0, 2, '2016-07-22 09:38:02', '2016-07-22 09:42:17', NULL, 0, 0);
INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(17, 9, NULL, 'خواندن و ارسال فایل csv به هدر برای دانلود', '<p dir="rtl">خواندن و ارسال فایل csv به هدر برای دانلود</p>\n\n<p dir="rtl">ابتدا توسط دستور زیر فایل مورد نظر را می خوانیم و درون یک آرایه می ریزیم&nbsp;:</p>\n\n<div class="code">$dir = new SplFileObject("./data/cars.csv"); // Your Path<br />\n$dir-&gt;setFlags(SplFileObject::READ_CSV); // تعیین فایل<br />\nforeach ($dir as $line) {<br />\n&nbsp; &nbsp; $cars[] = $line;<br />\n}</div>\n\n<p dir="rtl">سپس یک فایل csv در روی حافظه می سازیم :</p>\n\n<div class="code">$file = new \\SplTempFileObject();</div>\n\n<p dir="rtl">در فایل های csv همیشه وقتی توسط php خوانده می شوند اولین خانه عنوان سطرها می باشد</p>\n\n<p dir="rtl">پس برای خروجی هم به همین صورت عمل می کنیم :&nbsp;</p>\n\n<div class="code">foreach ($cars as $value) {<br />\n&nbsp; &nbsp; $file-&gt;fputcsv($value);<br />\n}</div>\n\n<p dir="rtl">سپس با دستورات زیر اطلاعات را در حافظه ذخیره و برای خروجی ارسال می کنیم :</p>\n\n<div class="code">\n<p>$file-&gt;rewind();// اطلاعات در حافظه ذخیره می شود<br />\nheader("Content-Type:text/csv"); // نوع خروجی را تعیین می کنیم<br />\nheader("Content-Disposition:attachment;filename=File.csv"); // فایل خود را به خروجی ارسال می کنیم<br />\n$file-&gt;fpassthru(); // فایل ساخته شده را ارسال می کند</p>\n\n<p>exit();</p>\n</div>\n\n<p dir="rtl">موفق باشید ...&nbsp;</p>\n\n<div>&nbsp;</div>\n\n<p dir="rtl">&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 5, '2016-07-22 10:49:47', '2016-07-22 11:02:34', NULL, 0, 0),
(18, 9, NULL, 'ذخیره آرایه ای از اطلاعات در فایل csv با php', '<p dir="rtl">ذخیره آرایه ای از اطلاعات در فایل csv با php</p>\n\n<p dir="rtl">آرایه را می سازیم شما می توانید از آرایه خود استفاده &nbsp;نمایید :&nbsp;</p>\n\n<div class="code">$csv = array(<br />\n&nbsp; &nbsp; array("title"=&gt;"Title 9","id"=&gt;1),<br />\n&nbsp; &nbsp; array("title"=&gt;"Title 8","id"=&gt;2),<br />\n&nbsp; &nbsp; array("title"=&gt;"Title 7","id"=&gt;3),<br />\n&nbsp; &nbsp; array("title"=&gt;"Title 6","id"=&gt;4),<br />\n&nbsp; &nbsp; array("title"=&gt;"Title 5","id"=&gt;5),<br />\n&nbsp; &nbsp; array("title"=&gt;"Title 4","id"=&gt;6),<br />\n&nbsp; &nbsp; array("title"=&gt;"Title 3","id"=&gt;7),<br />\n&nbsp; &nbsp; array("title"=&gt;"Title 2","id"=&gt;8)<br />\n);</div>\n\n<p dir="rtl">سپس یک فایل csv در روی حافظه می سازیم :</p>\n\n<div class="code">$file = new \\SplTempFileObject();</div>\n\n<p dir="rtl">در فایل های csv همیشه اولین خانه عنوان سطرها می باشد</p>\n\n<p dir="rtl">پس برای خروجی هم به همین صورت عمل می کنیم :&nbsp;</p>\n\n<div class="code">$title = array_keys($csv[0]);<br />\n$file-&gt;fputcsv($title);</div>\n\n<p dir="rtl">&nbsp;بقیه اطلاعات را درون آن می ریزیم :</p>\n\n<div class="code">foreach ($cars as $value) {<br />\n&nbsp; &nbsp; $file-&gt;fputcsv($value);<br />\n}</div>\n\n<p dir="rtl">سپس با دستورات زیر اطلاعات را در حافظه ذخیره و برای خروجی ارسال می کنیم :</p>\n\n<div class="code">\n<p>$file-&gt;rewind();// اطلاعات در حافظه ذخیره می شود<br />\nheader("Content-Type:text/csv"); // نوع خروجی را تعیین می کنیم<br />\nheader("Content-Disposition:attachment;filename=File.csv"); // فایل خود را به خروجی ارسال می کنیم<br />\n$file-&gt;fpassthru(); // فایل ساخته شده را ارسال می کند</p>\n\n<p>exit();</p>\n</div>\n\n<p dir="rtl">موفق باشید ...&nbsp;</p>\n\n<div>&nbsp;</div>\n\n<p dir="rtl">&nbsp;</p>\n\n<p dir="rtl">&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 5, '2016-07-22 11:03:36', NULL, NULL, 0, 0),
(19, 9, NULL, 'جستجو در فایل ها و پوشه ها درون یک دایرکتوری با php', '<p dir="rtl">جستجو در فایل ها و پوشه ها درون یک دایرکتوری با php</p>\n\n<p dir="rtl">ابتدا با دستور زیر اطلاعات یک دایرکتوری را بدست می آوریم :&nbsp;</p>\n\n<div class="code">$files = new RecursiveDirectoryIterator("./img"); // Your Path</div>\n\n<p dir="rtl">سپس توسط دستور زیر تمام فایل ها و پوشه های آن را بدست می آوریم :</p>\n\n<div class="code">$files = new RecursiveIteratorIterator($files);</div>\n\n<p dir="rtl">سپس با دستور زیر اطلاعاتی که می خواهیم را بدست می آوریم :&nbsp;</p>\n\n<div class="code">$files = new RegexIterator($files, "/\\.(?:jpg|php|png|csv|txt)$/i");</div>\n\n<p dir="rtl">پسوند ها ی مورد نیاز را وارد می کنیم.</p>\n\n<p dir="rtl">&nbsp;اطلاعات را در خروجی نمایش می دهیم :&nbsp;</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; foreach ($files as $key =&gt; $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value."&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">موفق باشید ...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 3, '2016-07-22 11:40:56', NULL, NULL, 0, 0),
(20, 9, NULL, 'خواندن فایل های xml با php', '<p dir="rtl">خواندن فایل های xml با php</p>\n\n<p dir="rtl">توسط دستور زیر اطلاعات xml را وارد حافظه می کنیم :&nbsp;</p>\n\n<div class="code">$xml = simplexml_load_file("./data/courses.xml");</div>\n\n<p dir="rtl">&nbsp;برای خواندن اطلاعات از حلقه استفاده می کنیم :</p>\n\n<div class="code">&nbsp;foreach ($xml as $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp;echo $value-&gt;title; // نام فیلد شما<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">توسط دستورات زیر می توانید تعداد خواندن اطلاعات را مشخص نمائید :&nbsp;</p>\n\n<div class="code">$xml = simplexml_load_file("./data/courses.xml",''SimpleXMLIterator'');<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $xml = new LimitIterator($xml,2,3);// پارامتر دوم آفست و سومی تعداد آن می باشد<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $matches = array();<br />\n&nbsp; &nbsp; &nbsp; &nbsp; foreach ($xml as $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value-&gt;title." ".$value-&gt;describtion." ".$value-&gt;author."&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">موفق باشید ...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 3, '2016-07-22 12:43:26', NULL, NULL, 0, 0),
(21, 10, NULL, 'متد سازنده در php', '<p dir="rtl">متد سازنده کلاس در php اولین متدی است که وقتی از کلاس یک شی ساخته می شود اجرا می شود . متد سازنده متدی است که هم نام با نام کلاس می باشد .</p>\n\n<p dir="rtl">مثال :&nbsp;</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; class Test{<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; private $name;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; function Test($name) { // متد سازنده کلاس<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $this-&gt;name = $name;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; public function getName() {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return $this-&gt;name;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $test = new Test("تست");<br />\n&nbsp; &nbsp; &nbsp; &nbsp; echo $test-&gt;getName(); // خروجی تست است</div>\n\n<p dir="rtl">در php می توان از متد های جادویی نیز استفاده نمود&nbsp;</p>\n\n<p dir="rtl">مثال :</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; class Test{<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; private $name;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; function __construct($name) { // متد سازنده کلاس<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $this-&gt;name = $name;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; public function getName() {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return $this-&gt;name;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $test = new Test("تست");<br />\n&nbsp; &nbsp; &nbsp; &nbsp; echo $test-&gt;getName();// خروجی تست است</div>\n\n<p dir="rtl">می توان از هر دو روش نیز برای ساخت متد سازنده استفاده نمود :</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; class Test{<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; private $name;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; function __construct($name) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $this-&gt;name = $name;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; function Test() {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $this-&gt;name="Test";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; public function getName() {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return $this-&gt;name;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $test = new Test();<br />\n&nbsp; &nbsp; &nbsp; &nbsp; echo $test-&gt;getName(); // Test</div>\n\n<p dir="rtl">می توان هر تعداد که لازم باشد متد سازنده با ورودی های مختلف تعریف نمود.</p>\n\n<p dir="rtl">موفق باشید ...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 1, 1, '2016-07-22 17:51:46', NULL, NULL, 0, 0),
(22, 10, NULL, 'متد های جادویی set و get در php', '<p dir="rtl">متد های جادویی set__ وget __&nbsp;در php</p>\n\n<p dir="rtl">می توان برای دسترسی به متغیر های تعریف شده در داخل کلاس از متدهای جادویی set و get استفاده نمود .</p>\n\n<p dir="rtl">مثال :&nbsp;</p>\n\n<p dir="rtl">ما جنس متغیر name را private قرار می دهیم تا به آن از خارج از کلاس دسترسی نداشته باشیم :</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; class Test{<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; private $name = "test";<br />\n<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $test = new Test();<br />\n&nbsp; &nbsp; &nbsp; &nbsp; echo $test-&gt;name;</div>\n\n<p dir="rtl">&nbsp;خروجی :&nbsp;</p>\n\n<div class="code"><b>Fatal error</b>: Cannot access private property Test::$name</div>\n\n<p dir="rtl">برای دسترسی به این مقدار از متد جادویی get استفاده می کنیم :</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; class Test{<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; private $name = "test";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; public function __get($name) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; if(property_exists($this, $name)){<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return $this-&gt;{$name};<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">اول بررسی می کنیم که این مقدار در داخل کلاس وجود دارد یا نه اگر وجود داشت این مقدار را بر می گردانیم .&nbsp;</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; $test = new Test();<br />\n&nbsp; &nbsp; &nbsp; &nbsp; echo $test-&gt;name; //&nbsp;test</div>\n\n<p dir="rtl">&nbsp;حالا با استفاده از متد جادویی get خروجی به صورت زیر می باشد</p>\n\n<div class="code">test</div>\n\n<p dir="rtl">حلا اگر ما بخواهیم برای این متغیر مقدار جدیدی وارد کنیم :</p>\n\n<div class="code"><b>Fatal error</b>: Cannot access private property Test::$name</div>\n\n<p dir="rtl">دوباره با این خطا رو به رو می شویم&nbsp;</p>\n\n<p dir="rtl">برای رفع این مشکل از متد جادویی set استفاده نماییم :</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; class Test{<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; private $name = "test";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; public function __get($name) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; if(property_exists($this, $name)){<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return $this-&gt;{$name};<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; public function __set($name,$value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; if(property_exists($this, $name)){<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $this-&gt;{$name} = $value;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $test = new Test();<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $test-&gt;name="Name Dynamicly";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; echo $test-&gt;name;// Name Dynamicly</div>\n\n<p dir="rtl">&nbsp;خروجی مقدار جدید خواهد بود</p>\n\n<p dir="rtl">موفق باشید ...</p>\n\n<p dir="rtl">&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 24, 2, '2016-07-22 18:18:15', NULL, NULL, 0, 0),
(23, 9, NULL, 'خواندن فایل های یک دایرکتوری و پوشه های آن با پسوند دلخواه با php', '<p dir="rtl">خواندن فایل های یک دایرکتوری و پوشه های آن با پسوند دلخواه با php</p>\n\n<p dir="rtl">ابتدا یک کلاس برای فیلتر خود تعریف می کنیم که از کلاس فیلتر کتابخانه استاندارد php ارس بری می کند :</p>\n\n<div class="code">\n<p>class FilterByExtension extends RecursiveFilterIterator {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; private $extension;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; function __construct($iterator,$extension) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; parent::__construct($iterator);<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $this-&gt;extension = $extension;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }</p>\n\n<p><br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; public function accept() {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; if($this-&gt;hasChildren()){<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return true;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $images = array("png","jpg","csv");<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return $this-&gt;current()-&gt;isFile() &amp;&amp; in_array($this-&gt;current()-&gt;getExtension(), $this-&gt;extension);<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; public function getChildren() {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return new self($this-&gt;getInnerIterator()-&gt;getChildren(), &nbsp;$this-&gt;extension);<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }</p>\n\n<p>}</p>\n</div>\n\n<p dir="rtl">سپس با دستور زیر آن را فراخوانی می کنیم :</p>\n\n<div class="code">&nbsp; &nbsp; &nbsp; &nbsp; $dir = new RecursiveDirectoryIterator(''.''); //خواندن دایرکتوری فعلی<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $dir-&gt;setFlags(FilesystemIterator::UNIX_PATHS);//حذف .و.. ازآن ها<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $file = new FilterByExtension($dir, array("jpg","csv","png"));// ساخت نمونه از روی کلاس با پسوند دلخواه<br />\n&nbsp; &nbsp; &nbsp; &nbsp; $file=new RecursiveIteratorIterator($file);//استفاده از &nbsp;این کلاس برای خواندن تمام مقدارها<br />\n&nbsp; &nbsp; &nbsp; &nbsp; foreach ($file as $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value-&gt;getPathName()."&lt;br&gt;";//نمایش اطلاعات در خروجی<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">موفق باشید ...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 1, 2, '2016-07-24 07:37:43', NULL, NULL, 0, 0),
(24, 9, NULL, 'استفاده از درخت ها در php', '<p dir="rtl"><strong>استفاده از درخت ها در php&nbsp;</strong></p>\n\n<p dir="rtl">&nbsp;</p>\n\n<p dir="rtl">در این آموزش قصد داریم خواندن یک آرایه به صورت درخت را در php آموزش دهیم :</p>\n\n<p dir="rtl">ابتدا یک آرایه تعریف می کنیم</p>\n\n<div class="code">$array= array("test","test2","test3"=&gt;array(<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "test1"=&gt;"test1",<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; "2"=&gt;"2",<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3=&gt;array(1,2,3,4)<br />\n&nbsp; &nbsp; &nbsp; &nbsp; ),"test4");</div>\n\n<p dir="rtl">&nbsp;سپس توسط دستور زیر مقدارهای آن را به صورت بازگشتی می خوانیم :&nbsp;</p>\n\n<div class="code">$tree = new RecursiveArrayIterator($array);</div>\n\n<p dir="rtl">&nbsp;حالا از توابع بازگشتی برای خواندن درخت استفده می کنیم :</p>\n\n<div class="code">$tree&nbsp;= new RecursiveTreeIterator($tree);</div>\n\n<p dir="rtl">حالا کافی است از یک آرایه برای نشان دادن مقادیر آن استفاده نمائیم &nbsp;</p>\n\n<div class="code">foreach ($tree as $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value.''&lt;br&gt;'';<br />\n&nbsp;}</div>\n\n<p dir="rtl">&nbsp;خروجی :</p>\n\n<div class="code">test<br />\n|-test2<br />\n|-Array<br />\n| |-test1<br />\n| |-2<br />\n| \\-Array<br />\n| |-1<br />\n| |-2<br />\n| |-3<br />\n| \\-4<br />\n\\-test4</div>\n\n<p dir="rtl">&nbsp;می توانیم توسط دستورات زیر اول و آخر درخت ها را از هم جدا کنیم:</p>\n\n<div class="code">$file-&gt;setPrefixPart(RecursiveTreeIterator::PREFIX_LEFT, "{"); // شروع را مشخص می کند<br />\n$file-&gt;setPrefixPart(RecursiveTreeIterator::PREFIX_END_HAS_NEXT, "-&gt;"); // سطح دوم را مشخص می کند<br />\n$file-&gt;setPrefixPart(RecursiveTreeIterator::PREFIX_MID_HAS_NEXT, "=&gt;");//سطح سوم را مشخص می کند<br />\n$file-&gt;setPrefixPart(RecursiveTreeIterator::PREFIX_END_LAST, "&lt;b&gt;}&lt;/b&gt;");//آخر آن را با این علامت مشخص می کند</div>\n\n<p dir="rtl">&nbsp;خروجی:</p>\n\n<div class="code">{-&gt;test<br />\n{-&gt;test2<br />\n{-&gt;Array<br />\n{=&gt;-&gt;test1<br />\n{=&gt;-&gt;2<br />\n{=&gt;<b>}</b>Array<br />\n{=&gt; -&gt;1<br />\n{=&gt; -&gt;2<br />\n{=&gt; -&gt;3<br />\n{=&gt;&nbsp;<b>}</b>4<br />\n{<b>}</b>test4</div>\n\n<p dir="rtl">موفق باشید....</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 3, 1, '2016-08-02 20:24:15', '2016-08-02 20:24:53', NULL, 0, 0),
(25, 9, NULL, 'استفاده از لیست های پیوندی در php', '<p dir="rtl">استفاده از لیست های پیوندی در php&nbsp;</p>\n\n<p dir="rtl">در این آموزش ما از یک فایل xml استفاده می نمائیم که اطلاعات آن در آخر همین صفحه قابل مشاهده و کپی برداری می باشد.</p>\n\n<p dir="rtl">ابتدا اطلاعات فایل xml خود را می خوانیم :</p>\n\n<div class="code">$data = simplexml_load_file("courses.xml"); // Your Path</div>\n\n<p dir="rtl">&nbsp;توسط دستور &nbsp;یک متغیر از نوع لیست پیوندی php می سازیم :</p>\n\n<div class="code">$courses = new SplDoublyLinkedList();//کلاس لیست پیوندی &nbsp;</div>\n\n<p dir="rtl">&nbsp;حالا اطلاعات خود را درون لیست های پیوندی می ریزیم :</p>\n\n<div class="code">foreach ($data as $item) { &nbsp;// اطلاعات خوانده شده<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;if($courses-&gt;isEmpty()){ // بررسی میکند که آیا این لیست خالی می باشد یا نه<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$courses-&gt;push($item); // اگر خالی بود اطلاعات را درون آن می ریزد<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;}else{<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$last_name = getLastName($item-&gt;author); // این تابع نام خانوادگی نویسنده را بر میگرداند که در قسمت پایین می بینید<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$courses-&gt;rewind();//اشاره گر لیست را به اول لیست بر می گرداند<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;while ($courses-&gt;valid() &amp;&amp; getLastName($courses-&gt;current()-&gt;author) &lt;= $last_name) { &nbsp;// بررسی می کند که لیست برای افزودن مقدار جا دارد اگر جا داشت این آیتم را بعد از نام مشابه نام خودش درج می کند<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$courses-&gt;next(); // اشاره گر لیست را یکی به جلو حرکت می دهد<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;}<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;$courses-&gt;add($courses-&gt;key(), $item); //نام را به لیست اضافه می کند<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp;&nbsp;}</div>\n\n<div class="code">function getLastName($author) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $pos = strpos($author, '' ''); // &nbsp;موقعیت نام خانوادگی را بدست می آوریم<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; return substr($author, $pos + 1); // توسط این دستور نام خانوادگی را از نام جدا می کنیم<br />\n&nbsp;}</div>\n\n<p dir="rtl">کد xml فایل :</p>\n\n<div class="code">&lt;courses&gt;<br />\n&nbsp; &nbsp; &lt;course&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;title&gt;Accessing Databases with Object-Oriented PHP&lt;/title&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;author&gt;David Powers&lt;/author&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;description&gt;Learn how to access and manipulate databases using the object-oriented PHP extensions PDO and MySQLi.&lt;/description&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;level&gt;Intermediate&lt;/level&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;duration&gt;3h 47m&lt;/duration&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;pubdate&gt;2014-07-07&lt;/pubdate&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;subjects&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Developer&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Programming Languages&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Web Development&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/subjects&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;software&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;type&gt;PHP&lt;/type&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/software&gt;<br />\n&nbsp; &nbsp; &lt;/course&gt;<br />\n&nbsp; &nbsp; &lt;course&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;title&gt;Creating Secure PHP Websites&lt;/title&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;author&gt;Kevin Skoglund&lt;/author&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;description&gt;Learn how to meet the most important security challenges when developing websites with PHP.&lt;/description&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;level&gt;Intermediate&lt;/level&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;duration&gt;4h 16m&lt;/duration&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;pubdate&gt;2014-06-30&lt;/pubdate&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;subjects&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Developer&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Programming Languages&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/subjects&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;software&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;type&gt;PHP&lt;/type&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/software&gt;<br />\n&nbsp; &nbsp; &lt;/course&gt;<br />\n&nbsp; &nbsp; &lt;course&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;title&gt;Up and Running with Linux for PHP Developers&lt;/title&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;author&gt;Jon Peck&lt;/author&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;description&gt;Need a powerful development environment? Learn how to quickly install and configure a virtual Linux web server on your Mac or Windows computer.&lt;/description&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;level&gt;Beginner&lt;/level&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;duration&gt;3h 52m&lt;/duration&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;pubdate&gt;2014-06-13&lt;/pubdate&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;subjects&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Developer&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Servers&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/subjects&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;software&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;type&gt;MySQL&lt;/type&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;type&gt;PHP&lt;/type&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;type&gt;Linux&lt;/type&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;type&gt;Apache&lt;/type&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;type&gt;LAMP&lt;/type&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/software&gt;<br />\n&nbsp; &nbsp; &lt;/course&gt;<br />\n&nbsp; &nbsp; &lt;course&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;title&gt;Exporting Data to Files with PHP&lt;/title&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;author&gt;David Powers&lt;/author&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;description&gt;Learn how to export data from a database with PHP in a variety of formats, including: rich text, CSV, Excel, Word, OpenOffice spreadsheets and documents, and even XML.&lt;/description&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;level&gt;Intermediate&lt;/level&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;duration&gt;3h 42m&lt;/duration&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;pubdate&gt;2014-04-11&lt;/pubdate&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;subjects&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Developer&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Databases&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;subject&gt;Web Development&lt;/subject&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/subjects&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;software&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &lt;type&gt;PHP&lt;/type&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/software&gt;<br />\n&nbsp; &nbsp; &lt;/course&gt;<br />\n&lt;/courses&gt;</div>\n\n<p dir="rtl">&nbsp;خروجی :</p>\n\n<div class="code">Jon Peck: Up and Running with Linux for PHP Developers (duration : 3h 52m)&nbsp;<br />\nDavid Powers: Accessing Databases with Object-Oriented PHP (duration : 3h 47m)&nbsp;<br />\nDavid Powers: Exporting Data to Files with PHP (duration : 3h 42m)&nbsp;<br />\nKevin Skoglund: Creating Secure PHP Websites (duration : 4h 16m)&nbsp;</div>\n\n<p dir="rtl">موفق باشید...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 3, '2016-08-04 11:47:26', NULL, NULL, 0, 0),
(26, 9, NULL, 'استفاده از استک و صف در php', '<p dir="rtl">استفاده از استک و صف&nbsp;در php</p>\n\n<p dir="rtl">در php ورژن 5.5 به بعد کلاس های استک و صف به php اضافه شد.</p>\n\n<p dir="rtl">استک : به ظرفی درون حافظه می گویند که در آن آخرین مقداری که وارد شده است اول از همه خارج می شود.</p>\n\n<p dir="rtl">صف : به خانه های پشت سر هم در حافظه که ترتیب مقادیر وارد شده در آن رعایت می شود صف می گویند و آخرین مقداری که وارد شده آخر از همه خارج می شود .</p>\n\n<p dir="rtl"><strong>استفاده از استک&nbsp;</strong></p>\n\n<p dir="rtl">ابتدا یک نمونه از روی کلاس آن می سازیم :</p>\n\n<div class="code">$stack = new SplStack();</div>\n\n<p dir="rtl">&nbsp;سپس مقادیری که می خواهیم را وارد آن می کنیم :</p>\n\n<div class="code">$stack[] =''A''; //مقادیر را به صورت آرایه می توان وارد نمود<br />\n$stack-&gt;push("B");//از توابع خود استک برای افزودن مقدار می توان استفاده نمود<br />\n$stack-&gt;push("C");<br />\n$stack[] = ''D'';</div>\n\n<p dir="rtl">&nbsp;حال برای استفاده از اطلاعات می توان از یک حلقه استفاده نمود :</p>\n\n<div class="code">echo ''&lt;h2&gt;Stack&lt;/h2&gt;'';<br />\n&nbsp; &nbsp; &nbsp; &nbsp; foreach ($stack as $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; echo $value."&lt;br&gt;";<br />\n&nbsp; &nbsp; &nbsp; &nbsp; }</div>\n\n<p dir="rtl">&nbsp;خروجی :</p>\n\n<div class="code">\n<h2>Stack</h2>\n\n<p>D<br />\nC<br />\nB<br />\nA</p>\n</div>\n\n<p dir="rtl">می توان یکی از مقدارهای آن را خارج نمود :</p>\n\n<div class="code">&nbsp;echo ''&lt;br&gt;This is pop stack : &lt;b&gt;''.$stack-&gt;pop()."&lt;/b&gt;"; // &nbsp;&nbsp;This is pop stack :&nbsp;<b>D</b></div>\n\n<p dir="rtl">&nbsp;با استفاده از دستور زیر بعد از خواندن اطلاعات آن ها را پاک می کند(قبل از حلقه باید نوشته شود):</p>\n\n<div class="code">$stack-&gt;setIteratorMode(SplStack::IT_MODE_DELETE);&nbsp;</div>\n\n<p dir="rtl"><strong>استفاده از صف</strong></p>\n\n<p dir="rtl">ابتدا یک نمونه از روی کلاس آن می سازیم مثل بالا :&nbsp;</p>\n\n<div class="code">$queue = new SplQueue();</div>\n\n<p dir="rtl">&nbsp;سپس مقادیری که می خواهیم را وارد آن می کنیم :&nbsp;</p>\n\n<div class="code">$queue-&gt;enqueue("A"); //توسط این دستور مقدار را وارد صف می کنیم<br />\n$queue-&gt;enqueue("B");<br />\n$queue[] =''C'';// به این روش هم می توان مقدار وارد صف کنیم<br />\n$queue[] = ''D'';<br />\n$queue-&gt;push(''E''); // توسط این دستور هم می توان مقدار جدیدی به آن ها افزود</div>\n\n<p dir="rtl">&nbsp;حال برای استفاده از اطلاعات می توان از یک حلقه استفاده نمود :&nbsp;</p>\n\n<div class="code">echo ''&lt;h2&gt;Queue&lt;/h2&gt;'';<br />\nforeach ($queue as $value) {<br />\n&nbsp; &nbsp; &nbsp; echo $value.''&lt;br&gt;'';<br />\n}</div>\n\n<p dir="rtl">&nbsp;&nbsp;خروجی :&nbsp;</p>\n\n<div class="code">\n<h2>Queue</h2>\n\n<p>A<br />\nB<br />\nC<br />\nD<br />\nE</p>\n</div>\n\n<p dir="rtl">&nbsp;می توان یکی از مقدارهای آن را خارج نمود :</p>\n\n<div class="code">echo ''&lt;br&gt;This is dequeue : &lt;b&gt; ''.$queue-&gt;dequeue().''&lt;/b&gt;''; // &nbsp;This is dequeue :&nbsp;<b>A</b></div>\n\n<p dir="rtl">&nbsp;&nbsp;با استفاده از دستور زیر بعد از خواندن اطلاعات آن ها را پاک می کند(قبل از حلقه باید نوشته شود):</p>\n\n<div class="code">$queue-&gt;setIteratorMode(SplQueue::IT_MODE_DELETE);</div>\n\n<p dir="rtl">موفق باشید...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 2, '2016-08-05 13:13:04', NULL, NULL, 0, 0),
(27, 9, NULL, 'استفاده از Heap در php', '<p dir="rtl">استفاده از heap در php</p>\n\n<p dir="rtl">تعریف heap : هیپ به درخت هایی گفته می شود که زیر ریشه آن از دو عدد بیشتر نمی تواند باشد و دونوع هیپ داریم از کوچک به بزرگ و از بزرگ به کوچک در نوع اول زیر ریشه ها نمی تواند از ریشه خود بزرگتر باشند و در نوع دوم زیر ریشه ها نمی تواند از ریشه خود کوچکتر باشد .</p>\n\n<p dir="rtl"><strong>استفاده از هیپ کوچک به بزرگ&nbsp;</strong></p>\n\n<p dir="rtl">ابتدا یک نمونه از کلاس آن می سازیم :&nbsp;</p>\n\n<div class="code">$array = array(15,18,13,12,10,20);<br />\n$minHeap = new SplMinHeap();</div>\n\n<p dir="rtl">&nbsp;سپس اطلاعاتی که می خواهیم به آن اضافه می کنیم :&nbsp;</p>\n\n<div class="code">foreach ($array as $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $minHeap-&gt;insert($value);&nbsp;}</div>\n\n<p dir="rtl">حالا اطلاعات را در خروجی نمایش می دهیم :&nbsp;&nbsp;</p>\n\n<div class="code">echo ''&lt;pre&gt;'';<br />\n&nbsp;var_dump($minHeap);</div>\n\n<p dir="rtl">&nbsp;خروجی :&nbsp;</p>\n\n<div class="code">\n<pre>\nobject(SplMinHeap)#1 (3) {\n  ["flags":"SplHeap":private]=&gt;\n  int(0)\n  ["isCorrupted":"SplHeap":private]=&gt;\n  bool(false)\n  ["heap":"SplHeap":private]=&gt;\n  array(6) {\n    [0]=&gt;\n    int(10) // ریشه اول\n    [1]=&gt;\n    int(12)//ریشه سمت راست\n    [2]=&gt;\n    int(15)//ریشه سمت چپ\n    [3]=&gt;\n    int(18)//زیر ریشه سمت راست\n    [4]=&gt;\n    int(13)//زیر ریشه سمت راست\n    [5]=&gt;\n    int(20)// زیر ریشه سمت چپ\n  }\n}\n</pre>\n</div>\n\n<p dir="rtl"><strong>استفاده از هیپ بزرگ به کوچک</strong></p>\n\n<p dir="rtl">ابتدا یک نمونه از کلاس آن می سازیم :&nbsp;</p>\n\n<div class="code">$array = array(15,18,13,12,10,20);</div>\n\n<div class="code">$maxHeap = new SplMaxHeap();</div>\n\n<p dir="rtl">&nbsp;&nbsp;سپس اطلاعاتی که می خواهیم به آن اضافه می کنیم :&nbsp;</p>\n\n<div class="code">foreach ($array as $value) {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $maxHeap-&gt;insert($value);<br />\n&nbsp;}</div>\n\n<p dir="rtl">&nbsp;حالا اطلاعات را در خروجی نمایش می دهیم :</p>\n\n<div class="code">echo ''&lt;pre&gt;'';<br />\nvar_dump($maxHeap);</div>\n\n<p dir="rtl">&nbsp;خروجی:</p>\n\n<div class="code">\n<pre>\nobject(SplMaxHeap)#2 (3) {\n  ["flags":"SplHeap":private]=&gt;\n  int(0)\n  ["isCorrupted":"SplHeap":private]=&gt;\n  bool(false)\n  ["heap":"SplHeap":private]=&gt;\n  array(6) {\n    [0]=&gt;\n    int(20) // ریشه اول\n    [1]=&gt;\n    int(15)//ریشه سمت راست\n    [2]=&gt;\n    int(18)//ریشه سمت چپ\n    [3]=&gt;\n    int(12)//زیر ریشه سمت راست\n    [4]=&gt;\n    int(10)//زیر ریشه سمت راست\n    [5]=&gt;\n    int(13)//زیر ریشه سمت چپ\n  }\n}</pre>\n</div>\n\n<p dir="rtl">موفق باشید...</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<p dir="rtl">&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 6, 2, '2016-08-05 15:57:52', '2016-08-05 16:00:09', NULL, 0, 0),
(28, 11, NULL, 'مقدمه AngularJs', '<p dir="rtl"><strong>مقدمه&nbsp;</strong></p>\n\n<p dir="rtl">آنگولار یک فریمورک بر پایه جاوا اسکریپت می باشد که توسط یکی از کارکنان شرکت گوگل طراحی و چون قابلیت های زیادی داشت توسط خود گوگل مورد توجه قرار گرفت و گوگل شروع به توسعه آن نمود.این فریمورک بر پایه مدل MV* طراحی شده است و * به این معنی است که شما آن را با هرمدلی که خواستید می توانید پیاده سازی نمائید.با استفاده از این فریمورک شما می توانید از تگ های html5 استفاده و حتی هر element که خواستید تعریف و از آن استفاده نمائید.</p>\n\n<p dir="rtl">شما می توانید این فریمورک را از <a href="http://angularjs.org">اینجا</a> دانلود نمائید.</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 1, 1, '2016-08-06 07:17:40', NULL, NULL, 0, 0),
(29, 11, NULL, 'ساخت اولین صفحه با AngularJs', '<p dir="rtl">ساخت اولین صفحه&nbsp;</p>\n\n<p dir="rtl">ابتدا یک صفحه html با کتابخانه Angular می سازیم :</p>\n\n<div class="code">&lt;html&gt;<br />\n&nbsp; &nbsp; &lt;head&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;meta charset="UTF-8"&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;title&gt;&lt;/title&gt;<br />\n&nbsp; &nbsp; &lt;/head&gt;<br />\n&nbsp; &nbsp; &lt;body&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/angular.min.js" type="text/javascript"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &lt;/body&gt;<br />\n&lt;/html&gt;</div>\n\n<p dir="rtl">ساختار یک صفحه که قرار با آنگولار کار کند به صورت کلی به صورت زیر است :&nbsp;</p>\n\n<div class="code">&lt;html ng-app&gt; // به مکانی که انگولار با آن کار می کند اشاره می کند<br />\n&nbsp; &nbsp; &lt;head&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;meta charset="UTF-8"&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;title&gt;&lt;/title&gt;<br />\n&nbsp; &nbsp; &lt;/head&gt;<br />\n&nbsp; &nbsp; &lt;body&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;h1 ng-controller="Test"&gt; // نام کنترلر و مکانی که قرار است توسط این کنترلر مدیریت شود<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; {{helloMessage}} // یک متغیر که در این کنترلر قرار است نمایش داده شود<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/h1&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/angular.min.js" type="text/javascript"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script type="text/javascript"&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; function Test($scope){ // نام کنترلر ما اسکوپ به مکانی که کنترلر آن را مدیریت می کند اشاره می کند<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; $scope.helloMessage = "Hello World"; //اطلاعات این متغیر<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; }<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/script&gt;<br />\n&nbsp; &nbsp; &lt;/body&gt;<br />\n&lt;/html&gt;</div>\n\n<p dir="rtl">خروجی :&nbsp;</p>\n\n<div class="code">\n<h1 ng-controller="Test">Hello World</h1>\n</div>\n\n<p dir="rtl">اگر گیج شدید نگران نباشید در آموزش های بعدی به طور مفصل راجع به این توابع صحبت خواهیم کرد .</p>\n\n<p dir="rtl">&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 1, 2, '2016-08-06 07:34:02', NULL, NULL, 0, 0);
INSERT INTO `content` (`id`, `ctg_id`, `user_id`, `title`, `content`, `visit`, `order_list`, `created_at`, `updated_at`, `file`, `like_users`, `slider`) VALUES
(30, 11, NULL, 'کنترلر و اسکوپ در انگولار', '<p dir="rtl"><strong>کنترلر و اسکوپ</strong></p>\n\n<p dir="rtl">کنترلر : به مکانی که ما تعیین می کنیم و آن را با ng-controller مشخص میکنیم را یک کنترلر می نامند و توسط خود این این کنترلر به محدوده این ng-controller دسترسی داریم .</p>\n\n<p dir="rtl">Scope یا اسکوپ : به محدوده این کنترلر اسکوپ می گویند.</p>\n\n<p dir="rtl">مثال :</p>\n\n<div class="code">&lt;div ng-controller="HelloWorld"&gt; &lt;p&gt;{{hello}}&lt;/p&gt; &nbsp;&lt;/div&gt;&lt;p&gt;{{test}}&lt;/p&gt;</div>\n\n<p dir="rtl">ما توسط کنترلر HelloWorld به مقدار hello دسترسی داریم و می توانیم آن را تعیین کنیم و خارج از آن در قسمت test به آن دسترسی نداریم چون جزء محدوده یا اسکوپ این کنترلر نمی باشد.</p>\n\n<p dir="rtl">به طور کلی کنترلر را می توان به صورت زیر تشریح کرد :</p>\n\n<p><img alt="" border="0" height="452" hspace="0" src="data:image/png;base64," style="width:540px;height:452px;margin-top:0px;margin-bottom:0px;margin-left:0px;margin-right:0px;border:0px solid black;" vspace="0" width="540" /></p>\n\n<p dir="rtl">موفق باشید...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 3, '2016-08-06 07:47:08', NULL, NULL, 0, 0),
(31, 11, NULL, 'ساخت اولین پروژه با AngularJs', '<p dir="rtl"><strong>ساخت اولین پروژه با انگولار</strong></p>\n\n<p dir="rtl">ابتدا ساختار را تعیین می کنیم</p>\n\n<p>Angular/</p>\n\n<p>Angular/js/فایل های جاوا اسکریپت در این قسمت قرار می گیرند</p>\n\n<p>Angular/css/فایل سی اس اس در این قسمت قرار می گیرند</p>\n\n<p dir="rtl">ابن اموزش بر اساس ورژن ۱.۲.۶ انگولار&nbsp;نوشته شده است پس این ورژن را به همراه angular-route دانلود نمائید و در پوشه js قرار دهید.شما می توانید از <a href="http://angularjs.org">اینجا</a> یا ازسایت های فارسی این کتابخانه ها را دانلود نمائید.</p>\n\n<p dir="rtl">سپس اولین صفحه خود را تعریف نمائید .</p>\n\n<div class="code">&lt;html ng-app="myApp"&gt;<br />\n&nbsp; &nbsp; &lt;head&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;meta charset="UTF-8"&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;title&gt;&lt;/title&gt;<br />\n&nbsp; &nbsp; &lt;/head&gt;<br />\n&nbsp; &nbsp; &lt;body ng-controller="myController"&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;h1&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; {{helloMessage}}<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/h1&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/angular.min.js" type="text/javascript"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/angular-route.min.js"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/controller.js"&gt;&lt;/script&gt; //کنترلر های ما در این فایل قرار می گیرد<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/directive.js"&gt;&lt;/script&gt; // دایرکتیوهای ما در این فایل قرار می گیرد<br />\n&nbsp; &nbsp; &lt;/body&gt;<br />\n&lt;/html&gt;</div>\n\n<p dir="rtl">&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 3, '2016-08-06 07:58:16', '2016-08-09 07:18:29', NULL, 0, 0),
(32, 11, NULL, 'ساخت اولین کنترلر', '<p dir="rtl"><strong>ساخت اولین کنترلر</strong></p>\n\n<p dir="rtl">ابتدا یک صفحه html به همراه لینک کنترلرها ایجاد می نمائیم :</p>\n\n<div class="code">&lt;html ng-app="myApp"&gt; //نام اپلیکیشنی که به این قسمت اشاره می کند می باشد<br />\n&nbsp; &nbsp; &lt;head&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;meta charset="UTF-8"&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;title&gt;&lt;/title&gt;<br />\n&nbsp; &nbsp; &lt;/head&gt;<br />\n&nbsp; &nbsp; &lt;body ng-controller="myController"&gt; // نام کنترلر ما<br />\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;h1&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; {{helloMessage}} // متنی که می خواهیم در خروجی نمایش دهیم<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;/h1&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/angular.min.js" type="text/javascript"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/angular-route.min.js"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/controller.js"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &lt;/body&gt;<br />\n&lt;/html&gt;</div>\n\n<p dir="rtl">حالا فایل کنترلر خود را می سازیم :</p>\n\n<div class="code">angular.module(''myApp'',[])&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; .controller(''myController'',function($scope){&nbsp;<br />\n&nbsp; &nbsp;$scope.helloMessage = "Hello World"; &nbsp;<br />\n});</div>\n\n<p dir="rtl">خط اول&nbsp; به نام اپلیکیشن که در بالای صفحه html مشخص کردیم اشاره می کند .</p>\n\n<p dir="rtl">خط دوم&nbsp;ابتدا نام کنترلر و بعد از آن توابع آنگولاری که می خواهیم از آن ها استفاده کنیم را در ورودی تابع قرار می دهیم .</p>\n\n<p dir="rtl">خط سوم پارامتر اول به محدوده دسترسی این کنترلر اشاره می کند و پارامتر دوم نام متغیر می باشد .</p>\n\n<p dir="rtl">خروجی :&nbsp;</p>\n\n<div class="code">\n<h1>Hello World</h1>\n</div>\n\n<p dir="rtl">&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 4, '2016-08-09 07:28:55', NULL, NULL, 0, 0),
(33, 11, NULL, 'ساخت یک دایرکتیو با AngularJs', '<p dir="rtl">ساخت یک دایرکتیو با AngularJs</p>\n\n<p dir="rtl">ابتدا فایل html خود را می سازیم :</p>\n\n<div class="code">&lt;html ng-app="myApp"&gt;<br />\n&nbsp; &nbsp; &lt;head&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;meta charset="UTF-8"&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;title&gt;&lt;/title&gt;<br />\n&nbsp; &nbsp; &lt;/head&gt;<br />\n&nbsp; &nbsp; &lt;body ng-controller="myController"&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;h1 hello&gt;&lt;/h1&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/angular.min.js" type="text/javascript"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/angular-route.min.js"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &nbsp; &nbsp; &lt;script src="js/directive.js"&gt;&lt;/script&gt;<br />\n&nbsp; &nbsp; &lt;/body&gt;<br />\n&lt;/html&gt;</div>\n\n<p dir="rtl">سپس فایل دایرکتیو به شکل زیر درست می کنیم :</p>\n\n<div class="code">angular.module(''myApp'',[]).directive(''hello'',function(){<br />\n&nbsp; &nbsp; return {<br />\n&nbsp; &nbsp; &nbsp; &nbsp; ''restrict'' :''A'',<br />\n&nbsp; &nbsp; &nbsp; &nbsp; ''template'':''&lt;h1&gt;hello world&lt;h1&gt;''<br />\n&nbsp; &nbsp; }&nbsp;<br />\n});<br />\n&nbsp;</div>\n\n<p dir="rtl">خط اول به نام اپلیکیشن ما و توابع انگولار اشاره می کند.</p>\n\n<p dir="rtl">در داخل تابع ما به تگ h1 یک خروجی تولید می کنیم .</p>\n\n<p dir="rtl">خروجی :‌</p>\n\n<div class="code">\n<h1>hello world</h1>\n</div>\n\n<p dir="rtl">&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 1, 2, '2016-08-09 07:39:19', NULL, NULL, 0, 0),
(34, 13, NULL, 'آشنایی با سرولت ها', '<p dir="rtl">آشنایی با سرولت در جاوا</p>\n\n<p dir="rtl">در جاوا برای کار با وب تکنولوژی های زیادی بوجود آمده است که سریعترین و اولین آن ها سرولت نام دارد.به طور کلی سرولت ها در خواست ها را در یافت و پردازش و پاسخ آن ها را ارسال می کنند.</p>\n\n<p dir="rtl">ساختار کلی سرولت ها به صورت زیر می باشد:</p>\n\n<div class="code">import java.servlet.annotation.WebServlet; // حاشیه نویسی که توسط جاوا اجرا می شود\n<p>import java.servlet.http.HttpServlet; // کلاس سرولت&nbsp;</p>\n\n<p>import java.servlet.http.HttpServletResponse; // کلاس پاسخ های سرولت</p>\n\n<p>import java.servlet.http.HttpServletRequest; // کلاس درخواست های ارسال شده به سرولت</p>\n\n<p>@WebServlet(urlPatterns = "/test") // توسط جاوا اجرا می شود و مسیر این سرولت را مشخص می کند</p>\n\n<p>public class Test extends HttpServlet{ // یک سرولت با نام تست</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;protected void doGet(HttpServletRequest request,HttpServletResponse response){ // تمام در خواست های ارسال شده به روش گت &nbsp;وارد این متد می شوند</p>\n\n<p>&nbsp; &nbsp; &nbsp;// دستورات</p>\n\n<p>&nbsp; &nbsp; &nbsp;}</p>\n\n<p>&nbsp; &nbsp; &nbsp;protected void doPost(HttpServletRequest request,HttpServletResponse response){ // تمام درخواست های ارسال شده به روش پست وارد این متد می شوند</p>\n\n<p>&nbsp; &nbsp; &nbsp;// دستورات</p>\n\n<p>&nbsp; &nbsp; }</p>\n\n<p>&nbsp; &nbsp; &nbsp;protected void doPut(HttpServletRequest request,HttpServletResponse response){ // تمام درخواست های ارسال شده به روش پوت وارد این متد می شوند</p>\n\n<p>&nbsp; &nbsp; &nbsp;// دستورات</p>\n\n<p>&nbsp; &nbsp; }</p>\n\n<p>&nbsp; &nbsp; &nbsp;protected void doDelete(HttpServletRequest request,HttpServletResponse response){ // تمام درخواست های ارسال شده به روش دیلیت وارد این متد می شوند</p>\n\n<p>&nbsp; &nbsp; &nbsp;// دستورات</p>\n\n<p>&nbsp; &nbsp; }</p>\n\n<p>}</p>\n</div>\n\n<p dir="rtl">&nbsp;</p>\n\n<p dir="rtl">یه طور کلی ساختار سرولت ها به صورت بالا می باشد.</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 1, '2016-08-11 18:42:51', NULL, NULL, 0, 0),
(35, 13, NULL, 'دریافت مقدار و پردازش آن توسط سرولت', '<p dir="rtl">نحوه دریافت مقدار توسط سرولت و &nbsp;پردازش آن ها&nbsp;</p>\n\n<p dir="rtl">ابتدا یک سرولت می سازیم :</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">\n<p>import java.servlet.annotation.WebServlet; // حاشیه نویسی که توسط جاوا اجرا می شود<br />\nimport java.servlet.http.HttpServlet; // کلاس سرولت&nbsp;</p>\n\n<p>import java.servlet.http.HttpServletResponse; // کلاس پاسخ های سرولت</p>\n\n<p>import java.servlet.http.HttpServletRequest; // کلاس درخواست های ارسال شده به سرولت</p>\n\n<p>@WebServlet(urlPatterns = "/test") // توسط جاوا اجرا می شود و مسیر این سرولت را مشخص می کند</p>\n\n<p>public class Test extends HttpServlet{ // یک سرولت با نام تست</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp;protected void doGet(HttpServletRequest request,HttpServletResponse response){ // تمام در خواست های ارسال شده به روش گت &nbsp;وارد این متد می شوند</p>\n\n<p>&nbsp; &nbsp; &nbsp;// دستورات</p>\n\n<p>&nbsp; &nbsp; &nbsp;}</p>\n\n<p>&nbsp; &nbsp; &nbsp;protected void doPost(HttpServletRequest request,HttpServletResponse response){ // تمام درخواست های ارسال شده به روش پست وارد این متد می شوند</p>\n\n<p>&nbsp; &nbsp; &nbsp;// دستورات</p>\n\n<p>&nbsp; &nbsp; }</p>\n\n<p>}</p>\n</div>\n\n<p dir="rtl">سپس مقدار های ارسال شده به روش post را دریافت می کنیم :</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">\n<div>\n<p>protected void doPost(HttpServletRequest request,HttpServletResponse response){</p>\n\n<p>&nbsp; &nbsp; &nbsp;String name = request.getParameter(نام پارامتر ارسال شده);</p>\n\n<p>&nbsp; &nbsp; &nbsp;response.getWriter().println(متنی که میخواهیم در خروجی نمایش دهیم);</p>\n\n<p>&nbsp; &nbsp; }</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n</div>\n</div>\n\n<p dir="rtl">&nbsp;موفق باشید...</p>\n', 0, 2, '2016-08-11 18:53:13', NULL, NULL, 0, 0),
(36, 14, NULL, 'آشنایی با jsp', '<p dir="rtl">آشنایی با jsp&nbsp;</p>\n\n<p dir="rtl">jsp مخفف java server page می باشد و همان طور که از نام آن مشخص است ترکیب کدهای جاوا با html می باشد.درون فایل های jsp شما به دستورات جاوا دسترسی دارید و می توانید از آن ها استفاده نمائید.</p>\n\n<p dir="rtl">به طور کلی دستوراتی جاوا ٪&gt; شروع و با &lt;٪ &nbsp;پایان می یابد و درون آن ها دستورات جاوا قرار می گیرند.</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 1, 1, '2016-08-11 19:03:52', NULL, NULL, 0, 0),
(37, 15, NULL, 'استفاده از Runnable توسط lmbda', '<p dir="rtl">آموزش استفاده از متد های Runnable</p>\n\n<p dir="rtl">در حالت عادی استفاده از Runnable به صورت زیر می باشد :</p>\n\n<div class="code">\n<p>Runnable r = new Runnable(){&nbsp;</p>\n\n<p>&nbsp; &nbsp;@Override</p>\n\n<p>&nbsp; &nbsp;public void run(){ // دستورات</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; int i = 1;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; while(i++ &lt; 100){</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; System.out.println(i);</p>\n\n<p>&nbsp; &nbsp; }</p>\n\n<p>&nbsp; &nbsp;};</p>\n\n<p>&nbsp; &nbsp;r.run();</p>\n</div>\n\n<p dir="rtl">حال توسط Lambda به شکل زیر تعریف و استفاده می شود :</p>\n\n<div class="code">\n<p>Runnable r = () -&gt; {</p>\n\n<p>&nbsp; int i = 1;</p>\n\n<p>&nbsp; while(i++ &lt; 100){</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp;System.out.println(i);</p>\n\n<p>&nbsp; }</p>\n\n<p>};</p>\n\n<p>r.run();</p>\n</div>\n\n<p dir="rtl">متد های بالا دقیقا یک کار را انجام می دهند.</p>\n\n<p dir="rtl">موفق باشید...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 1, '2016-08-12 08:21:42', NULL, NULL, 0, 0),
(38, 15, NULL, 'استفاده از BinaryOperator توسط Lambda', '<p dir="rtl">استفاده از BinaryOperator توسط Lambda</p>\n\n<p dir="rtl">در حالت عادی BinaryOperator به صورت زیر می باشد :</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">\n<p>BinaryOperator&lt;Integer&gt; r = new BinaryOperator&lt;Integer&gt;(){</p>\n\n<p>@Override</p>\n\n<p>public Integer apply(Integer t,Integer u){</p>\n\n<p>return t + u;</p>\n\n<p>}</p>\n\n<p>};</p>\n\n<p>System.out.println(r.apply(12,14)); // 26</p>\n</div>\n\n<p dir="rtl">به صورت Lambda به شکل زیر می باشد :</p>\n\n<div class="code">\n<p>BinaryOperator r = (t , u) -&gt; t + u;</p>\n\n<p>System.out.println(r.apply(12,14)); // 26</p>\n</div>\n\n<p dir="rtl">حالت ساده تر آن به شکل زیر است :</p>\n\n<div class="code">\n<p>BinaryOperator r = Integer::sum;</p>\n\n<p>System.out.println(r.apply(12,14)); // 26</p>\n\n<p>BinaryOperator r = Integer::max;</p>\n\n<p>System.out.println(r.apply(12,14)); // 14</p>\n</div>\n\n<p dir="rtl">&nbsp;</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 2, '2016-08-12 08:36:00', NULL, NULL, 0, 0);
