(39, 16, NULL, 'آشنایی با فریمورک phalcon', '<p dir="rtl">آشنایی با فریمورک phalcon</p>\n\n<p dir="rtl">فریمورک phalcon به عنوان سریعترین فریمورک php شناخته شده است. و دلیل سرعت آن هم استفاده از اکستنشن های ربان c می باشد. به طور کلی فریمورک phalcon حالت یک وب سرور برای خود ایجاد و همیشه در حال اجرا می باشد.به همین دلیل سرعت پاسخگویی بسیار بالایی را دارا می باشد. این فریمورک بر پایه مدل mvc می باشد.</p>\n\n<p dir="rtl"><strong>ویژگی های فریمورک phalcon</strong></p>\n\n<ol dir="rtl">\n	<li>پشتیبانی کامل از مدل mvc</li>\n</ol>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-تک ماژول&nbsp;</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-چند ماژل</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;- اپلیکیشن های کوچک</p>\n\n<p dir="rtl">&nbsp; &nbsp; 2 . پشتیبانی از مدل های دیتابیس (ORM)</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; &nbsp;- Transaction - &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Behaviors</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; - Relation &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; - Events</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; - Hydration</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; - Profiling</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; - PHQL</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; - Validations</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp; - Logging</p>\n\n<p dir="rtl">&nbsp; &nbsp; &nbsp;- Sharding</p>\n', 0, 1, '2016-08-14 07:19:11', '2016-08-14 07:35:13', NULL, 0, 0),
(40, 17, NULL, 'آشنایی با Generic ها', '<p dir="rtl">آشنایی با Generic ها در جاوا</p>\n\n<p dir="rtl">در جاوا در بعضی قسمت ها ما نیاز به یک کلاس داریم که بتواند جنس های مختلفی از مقدارها یا کلاس ها را دریافت نماید.در این مواقع از Generic ها استفاده می کنیم.</p>\n\n<p dir="rtl">مثال :&nbsp;</p>\n\n<p dir="rtl">ابتدا یک کلاس Generic ایجاد می نمائیم :</p>\n\n<div class="code">\n<p>class Stash&lt;T&gt; {<br />\n&nbsp;private T x;</p>\n\n<p>&nbsp;public void set(T x){<br />\n&nbsp; &nbsp; &nbsp;this.x = x ;&nbsp;&nbsp; &nbsp;<br />\n&nbsp;}<br />\n&nbsp;public T get(){<br />\n&nbsp; return x;<br />\n&nbsp;}<br />\n}</p>\n</div>\n\n<p dir="rtl">در کلاس بالا علامت &lt;&gt; دلیل بر Generic بودن این کلاس می باشد.حال نوعی که درون این &lt;&gt; قرار می گیرد جنس ورودی می باشد که می تواند نوع خاصی مثل یک کلاس یا جنس متغیر باشد. در اینجا ما از T استفاده کرده ایم.که نشان می دهد ورودی هر چیزی می تواند باشد.</p>\n\n<p dir="rtl">حال از آن استفاده می نمائیم:</p>\n\n<div class="code">\n<p>public class StashOne{</p>\n\n<p>&nbsp; &nbsp;public static void main(String[] args){<br />\n&nbsp; &nbsp; &nbsp; Stash&lt;String&gt; stash = new Stash&lt;&gt;();<br />\n&nbsp; &nbsp; &nbsp; stash.set("Hello World");<br />\n&nbsp; &nbsp; &nbsp; String str = (String)stash.get();<br />\n&nbsp; &nbsp; &nbsp; System.out.println(str);&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp;}</p>\n\n<p>}<br />\n&nbsp;</p>\n</div>\n\n<p dir="rtl">همانطور که مشاهده می کنید ما یک نوع از کلاس جنریک خود ساخته ایم و به آن ورودی رشته را داده ایم.حال توسط یک متغیر از جنس رشته این مقدار را دریافت و در خروجی چاپ نموده ایم.</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 1, '2016-08-19 09:47:07', NULL, NULL, 0, 0),
(41, 17, NULL, 'استفاده از Generic ها', '<p dir="rtl">استفاده از Generic ها&nbsp;</p>\n\n<p dir="rtl">در مثال قبل با جنریک ها و نحوه تعریف آن ها آشنا شدید در این قسمت چند مثال از نحوه تعریف کردن آن ها به روش های مختلف می زنیم .</p>\n\n<p dir="rtl">می توانیم نوع ورودی جنریک ها را مشخص نمائیم :</p>\n\n<div class="code">\n<p>class Stash&lt;String&gt; {<br />\n&nbsp;private String x;</p>\n\n<p>&nbsp;public void set(String x){<br />\n&nbsp; &nbsp; &nbsp;this.x = x ;&nbsp;&nbsp; &nbsp;<br />\n&nbsp;}<br />\n&nbsp;public String get(){<br />\n&nbsp; return x;<br />\n&nbsp;}<br />\n}</p>\n</div>\n\n<p dir="rtl">در کلاس بالا به جای رشته هر چیز دیگری می تواند باشد از جمله کلاس یا نوع های دیگر.</p>\n\n<p dir="rtl">می توانیم تعیین کنیم که از کلاس خاصی ارث بری داشته باشد:</p>\n\n<div class="code">\n<p>class Stash&lt;T extends Number&gt; {<br />\n&nbsp;private T x;</p>\n\n<p>&nbsp;public void set(T x){<br />\n&nbsp; &nbsp; &nbsp;this.x = x ;&nbsp;&nbsp; &nbsp;<br />\n&nbsp;}<br />\n&nbsp;public T get(){<br />\n&nbsp; return x;<br />\n&nbsp;}<br />\n}</p>\n</div>\n\n<p dir="rtl">در کلاس بالا تعیین کردیم مقدار رودی باید از جنس عددی باشد مثل Integer یا Double.</p>\n\n<p dir="rtl">می توانیم از چند جنریک باهم استفاده نمائیم:</p>\n\n<div class="code">\n<p>class Test&lt;T,U&gt;{<br />\n&nbsp; public T left;<br />\n&nbsp; public U right;<br />\n&nbsp; public void set(T t,U u){<br />\n&nbsp; &nbsp; this.left = t;<br />\n&nbsp; &nbsp; this.right = u;<br />\n&nbsp; }<br />\n&nbsp;&nbsp;<br />\n&nbsp; public T getLeft(){<br />\n&nbsp; &nbsp; return this.left;<br />\n&nbsp; }</p>\n\n<p>&nbsp; public U getRight(){<br />\n&nbsp; &nbsp; return this.right;<br />\n&nbsp; }<br />\n}<br />\n&nbsp;</p>\n\n<p>class Stash&lt;T&gt; {<br />\n&nbsp; &nbsp;private T x;</p>\n\n<p>&nbsp; &nbsp;public void set(T x){<br />\n&nbsp; &nbsp; &nbsp; &nbsp;this.x = x ;&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp;}<br />\n&nbsp; &nbsp;public T get(){<br />\n&nbsp; &nbsp; &nbsp; return x;<br />\n&nbsp; &nbsp;}<br />\n}</p>\n</div>\n\n<p dir="rtl">حال با یک کلاس از آن ها استفاده می نمائيم‌:</p>\n\n<div class="code">\n<p>public class StashOne{</p>\n\n<p>&nbsp; &nbsp;public static void main(String[] args){<br />\n&nbsp; &nbsp; Test&lt;Integer,Integer&gt; test = new Test&lt;&gt;();<br />\n&nbsp; &nbsp; test.set(15,17);&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp; Stash&lt;Test&gt; s = new Stash&lt;&gt;();<br />\n&nbsp; &nbsp; s.set(test);<br />\n&nbsp; &nbsp; System.out.println("Left is : "+s.get().getLeft()+"\\nright is : "+s.get().getRight());&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp;}</p>\n\n<p>}</p>\n</div>\n\n<p dir="rtl">خروجی به شکل زیر خواهد بود :</p>\n\n<div class="code">Left is : 15<br />\nright is : 17</div>\n\n<p dir="rtl">موفق باشید ...</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 9, 2, '2016-08-19 12:52:07', NULL, NULL, 0, 0),
(42, 18, NULL, 'آشنایی با Collection ها در جاوا', '<p dir="rtl">آشنایی با collection ها</p>\n\n<p dir="rtl">در جاوا کتابخانه های کمکی بسیار زیادی برای کمک کردن به برنامه نویسان ایجاد شده است.از جمله این کتابخانه ها می توان به صف ها یا همان Collection ها اشاره نمود.به طور کلی ساختار صف ها به گونه ای است که اطلاعات را درون خانه های خود و پشت سر هم ذخیره می کنند و به شما دسترسی های بسیار زیادی از جمله مرتب کردن و جستجو و .. را می دهند .</p>\n\n<p dir="rtl">متد هایی کمکی آن ها به شرح زیر می باشد :</p>\n\n<ul>\n	<li>sort</li>\n	<li>Add</li>\n	<li>Delete</li>\n	<li>Search</li>\n	<li>Reverse</li>\n	<li>Copy</li>\n	<li>Fill</li>\n	<li>Swap</li>\n	<li>Shuffle</li>\n</ul>\n\n<p dir="rtl">&nbsp;و ... .</p>\n\n<p dir="rtl">حال به تعریف و استفاده از آن ها می پردازیم :&nbsp;</p>\n\n<p dir="rtl">&nbsp;</p>\n\n<div class="code">\n<p>import java.util.HashSet;</p>\n\n<p>public class CollectionOne{</p>\n\n<p>&nbsp; public static void main(String[] args){<br />\n&nbsp; &nbsp; new CollectionOne();<br />\n&nbsp; }</p>\n\n<p>&nbsp; public CollectionOne(){<br />\n&nbsp; &nbsp; &nbsp; HashSet&lt;String&gt; v = new HashSet&lt;String&gt;();<br />\n&nbsp; &nbsp; &nbsp; v.add("One");<br />\n&nbsp; &nbsp; &nbsp; v.add("Tow");<br />\n&nbsp; &nbsp; &nbsp; v.add("Three");<br />\n&nbsp; &nbsp; &nbsp; v.add("Four");&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp; &nbsp; for(String s : v){<br />\n&nbsp; &nbsp; &nbsp; &nbsp; System.out.println(s);<br />\n&nbsp; &nbsp; &nbsp; }&nbsp;&nbsp; &nbsp;<br />\n&nbsp; }&nbsp;&nbsp; &nbsp;</p>\n\n<p>}</p>\n</div>\n\n<p dir="rtl">در کلاس بالا از کلاس HashSet استفاده کرده ایم . داده ها را در خروجی چاپ کرده ایم.</p>\n\n<p dir="rtl">حا اگر بخواهیم بررسی کنیم مقداری خاص در این صف را به روش زیر عمل می کنیم:</p>\n\n<div class="code">\n<p>import java.util.HashSet;</p>\n\n<p>public class CollectionOne{</p>\n\n<p>&nbsp; public static void main(String[] args){<br />\n&nbsp; &nbsp; new CollectionOne();<br />\n&nbsp; }</p>\n\n<p>&nbsp; public CollectionOne(){<br />\n&nbsp; &nbsp; &nbsp; HashSet&lt;String&gt; v = new HashSet&lt;String&gt;();<br />\n&nbsp; &nbsp; &nbsp; v.add("One");<br />\n&nbsp; &nbsp; &nbsp; v.add("Tow");<br />\n&nbsp; &nbsp; &nbsp; v.add("Three");<br />\n&nbsp; &nbsp; &nbsp; v.add("Four");&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp; &nbsp; if(v.contains("One")){<br />\n&nbsp; &nbsp; &nbsp; &nbsp;System.out.println("exists");&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp; &nbsp; }&nbsp;&nbsp; &nbsp;<br />\n&nbsp; }&nbsp;&nbsp; &nbsp;<br />\n}</p>\n</div>\n\n<p dir="rtl">در مثال بالا بررسی می کنیم که مقدار One درون این صف وجود دارد یا خیر. اگر وجود داشت خروجی exists را چاپ می نماید.</p>\n\n<p dir="rtl">استفاده از LinkedHashSet</p>\n\n<div class="code">\n<p>import java.util.LinkedHashSet;</p>\n\n<p>public class CollectionOne{</p>\n\n<p>&nbsp; public static void main(String[] args){<br />\n&nbsp; &nbsp; new CollectionOne();<br />\n&nbsp; }</p>\n\n<p>&nbsp; public CollectionOne(){<br />\n&nbsp; &nbsp; &nbsp; LinkedHashSet&lt;String&gt; v = new LinkedHashSet&lt;String&gt;();<br />\n&nbsp; &nbsp; &nbsp; v.add("One");<br />\n&nbsp; &nbsp; &nbsp; v.add("Tow");<br />\n&nbsp; &nbsp; &nbsp; v.add("Three");<br />\n&nbsp; &nbsp; &nbsp; v.add("Four");&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp; &nbsp; if(v.contains("One")){<br />\n&nbsp; &nbsp; &nbsp; &nbsp;System.out.println("exists");&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp; &nbsp; }&nbsp;&nbsp; &nbsp;<br />\n&nbsp; }&nbsp;&nbsp; &nbsp;<br />\n}</p>\n</div>\n\n<p dir="rtl">مثل مثال قبلی عمل می کند فقط در نحوه ذخیره سازی اطلاعات فرق می کند.</p>\n\n<p dir="rtl">استفاده از TreeSet</p>\n\n<div class="code">\n<p>import java.util.TreeSet;</p>\n\n<p>public class CollectionOne{</p>\n\n<p>&nbsp; public static void main(String[] args){<br />\n&nbsp; &nbsp; new CollectionOne();<br />\n&nbsp; }</p>\n\n<p>&nbsp; public CollectionOne(){<br />\n&nbsp; &nbsp; &nbsp; TreeSet&lt;String&gt; v = new TreeSet&lt;String&gt;();<br />\n&nbsp; &nbsp; &nbsp; v.add("One");<br />\n&nbsp; &nbsp; &nbsp; v.add("Tow");<br />\n&nbsp; &nbsp; &nbsp; v.add("Three");<br />\n&nbsp; &nbsp; &nbsp; v.add("Four");&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp; &nbsp; if(v.contains("One")){<br />\n&nbsp; &nbsp; &nbsp; &nbsp;System.out.println("exists");&nbsp;&nbsp; &nbsp;<br />\n&nbsp; &nbsp; &nbsp; }&nbsp;&nbsp; &nbsp;<br />\n&nbsp; }&nbsp;&nbsp; &nbsp;<br />\n}</p>\n</div>\n\n<p dir="rtl">دقیقا مثل دو مثال قبلی کار میکند فقط در ذخیره سازی اطلاعات فرق می کند.</p>\n<style type="text/css">.code{\n;background-color:#757575;border-radius:2px;box-shadow:0 0 4px #CCC;padding:5px;font-weight:bold;color:white;direction:ltr;text-align:left;\n}\n.code p{\ndirection:ltr !important;\n}\n</style>\n', 0, 1, '2016-08-19 14:34:26', NULL, NULL, 0, 0);

