CREATE TABLE IF NOT EXISTS `FactorSection` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) CHARACTER SET latin1 NOT NULL,
  `content` varchar(3000) CHARACTER SET latin1 DEFAULT NULL,
