(5, 'Learning Site', '<p>which returns only the last item, “yellow” , and stores it in the variable vItem . The array is then left<br />\nwith only the strings “red” and “green” .<br />\nThe push() method is actually the same as manually adding the array items as shown in previous<br />\nexamples. This example could be rewritten as the following:<br />\nvar stack = new Array;<br />\nstack[0] = “red”;<br />\nstack[1] = “green”;<br />\nstack[2] = “yellow”;<br />\nalert(stack.toString());<br />\nvar vItem = stack.pop();<br />\nalert(vItem);<br />\nalert(stack.toString());<br />\n//outputs “red,green,yellow”<br />\n//outputs “yellow”<br />\n//outputs “red,green”<br />\nThe Array also provides methods to manipulate the very first item. The shift() method removes the first<br />\nitem in the array and returns it as the function value. On the other end of the spectrum, the unshift()<br />\nmethod places an item into the first position of the array, shifting all other items down one position in the<br />\nprocess. Example:<br />\nvar aColors = [“red”, “green”, “yellow”];<br />\nvar vItem = aColors.shift();<br />\nalert(aColors.toString());<br />\n//outputs “green,yellow”<br />\nalert(vItem);<br />\n//outputs “red”<br />\naColors.unshift(“black”);<br />\nalert(aColors.toString());<br />\n//outputs “black,green,yellow”<br />\nIn this example, the string “red” is removed ( shift() ed) from the array, leaving only “green” and<br />\n“yellow” . By using the unshift() method, the string “black” is placed at the front of the array, effec-<br />\ntively replacing “red” as the new value in the first position.<br />\nBy using shift() and push() , it is possible to make an Array object behave like a queue. A queue is a<br />\nmember of the group of data structures that restricts the insertion and removal of elements. A queue is<br />\nreferred to as a last-in-last-out (LILO) structure, meaning that the most recently added element is the last<br />\none removed. The insertion of elements always occurs only at the back of the queue whereas the<br />\nremoval of elements occurs only at the front of the queue.<br />\nWhen you think of a queue, think of a line at the movies. When new people arrive to get tickets, they go<br />\nto the back of the line (Figure 3-3). This is traditionally called put or enqueue.<br />\nStart 1 2 3 4<br />\nPut 1 2 3 4<br />\nResult 1 2 3 4<br />\n5<br />\n5<br />\nFigure 3-3<br />\n75<br />\nwww.it-ebooks.infoChapter 3<br />\nThey wait their turns, eventually moving to the front of the line where they buy their tickets. After the<br />\npurchase is complete, the people leave the front of the line and go into the movies (Figure 3-4). This is<br />\ntraditionally called get or dequeue.<br />\n1<br />\nStart<br />\nGet<br />\nResult<br />\n1<br />\n2 3 4<br />\n2 3 4<br />\n2 3 4<br />\nFigure 3-4<br />\nAlthough the names of the methods aren’t the same, the functionality is the same. You add items to the<br />\nqueue using the push() method (adding items to the back of the array) and remove items from the<br />\nqueue by using the shift() method:<br />\nvar queue = [“red”, “green”, “yellow”];<br />\nqueue.push(“black”);<br />\nalert(queue.toString());<br />\n//outputs “red,green,yellow,black”<br />\nvar sNextColor = queue.shift();<br />\nalert(sNextColor);<br />\n//outputs “red”<br />\nalert(queue.toString());<br />\n//outputs “green,yellow,black”<br />\nIn this example, the string “black” is added to the back of the queue by using the push() method. In<br />\norder to get the next color, the shift() method is used to retrieve “red” , leaving the queue with only<br />\n“green” , “yellow” , and “black” .<br />\nTwo methods relate to the ordering of items in arrays, the reverse() and sort() methods. The<br />\nreverse() method, as one might expect, simply reverses the order of the items in an array. So if you<br />\nwant to reverse the order of “red” , “green” , “blue” , you do this:<br />\nvar aColors = [“red”, “green”, “blue”];<br />\naColors.reverse();<br />\nalert(aColors.toString());<br />\n//outputs “blue,green,red”<br />\nThe sort() method, on the other hand, arranges the item in the array by sorting them into ascending<br />\norder based on their values. To do this sort, transform all values into strings by calling their toString()<br />\nmethod. The items are compared by character code (as I described in the section on using the less-than<br />\noperator on strings). For example:<br />\nvar aColors = [“red”, “green”, “blue”, “yellow”];<br />\naColors.sort();<br />\nalert(aColors.toString());<br />\n//outputs “blue,green,red,yellow”<br />\n76<br />\nwww.it-ebooks.infoObject Basics<br />\nThis code sorts the strings “red” , “green” , “blue” , and “yellow” into alphabetical order by using<br />\ntheir character codes. Because all values are strings, this sort order is logical. If, however, the values are<br />\nnumbers, the result becomes bizarre:<br />\nvar aColors = [3, 32, 2, 5]<br />\naColors.sort();<br />\nalert(aColors.toString());<br />\n//outputs “2,3,32,5”<br />\nWhen trying to sort the numbers 3, 32, 2, and 5, the sort() method reorders the items into 2, 3, 32, and<br />\n5. As mentioned before, this occurs because the numbers are converted to strings and then compared by<br />\ncharacter code. This problem can be overcome. I discussed this further in Chapter 12, “Sorting Tables.”<br />\nThe most complicated method by far is splice() . The purpose of this method is quite simple really: to<br />\ninsert items into the middle of an array. The variety of ways that splice() uses to insert these items,<br />\nhowever, takes some getting used to:<br />\n? Deletion — You can delete any number of items from the array by specifying just two parame-<br />\nters, the starting position of the first item to delete and the number of items to delete. For exam-<br />\nple: arr.splice(0, 2) deletes the first two items in the array arr .<br />\n? Replacement without delete — You can insert items into a specific position by specifying three<br />\nparameters: the starting position, 0 (the number of items to delete), and the item to insert. You<br />\ncan optionally specify fourth, fifth, or any number of other parameters to insert. For example,<br />\narr.splice(2, 0, “red”, “green”) inserts the strings “red” and “green” into the array<br />\narr at position 2.<br />\n? Replacement with delete — You can insert items into a specific position while simultaneously<br />\ndeleting items by specifying three parameters: the starting position, the number of items to<br />\ndelete, and the item to insert. Here, you can also specify extra parameters to insert. The<br />\nnumber of items to insert doesn’t have to match the number of items to delete. For example,<br />\narr.splice(2, 1, “red”, “green”) deletes one item at position 2 and then inserts the<br />\nstrings “red” and “green” into the array arr at position 2 .<br />\nAs you can tell, the Array class is an extremely versatile and helpful object. Chapter 12 explores using<br />\narrays in a more practical manner, but for now, this information is all you need to know.<br />\nThe Date class<br />\nThe Date class in ECMAScript is based on earlier versions of java.util.Date from Java. ECMAScrip<img alt="" border="0" height="1200" hspace="0" src="data:image/jpeg;base64," style="width:1920px;height:1200px;margin-top:0px;margin-bottom:0px;margin-left:0px;margin-right:0px;border:0px solid black;" vspace="0" width="1920" /></p>\n', NULL, 'Learning', 'Leraning', 7, '2016-06-17 12:05:09', NULL);
