(6, 'LMS Site', '<p dir="ltr" style="text-align: left;">Internet Explorer displays February 2, 2003 as “Sat Feb 2 00:00:00 EST 2003” while Mozilla displays it as<br />\n“Tue Feb 2 2003 00:00:00 GMT-0400 (Eastern Daylight Time)”.<br />\nSeveral other methods are also designed to create alternate string representations of a particular date:<br />\n? toDateString() — displays only the date part of a Date (only the month, day, and year) in an<br />\nimplementation-dependent format<br />\n? toTimeString() — displays only the time part of a Date (hours, minutes, seconds, and time<br />\nzone) in an implementation-dependent format<br />\n? toLocaleString() — displays the date and time of a Date in a locale-specific format<br />\n? toLocaleDateString() — displays the date part of a Date value in a locale-specific format<br />\n? toLocaleTimeString() — displays the time part of a Date in a locale-specific format<br />\n? toUTCString() — displays the UTC date of a Date in an implementation-specific format<br />\nEach of these methods outputs different values in different implementations and locales, and for this<br />\nreason, care must be exercised when using them.<br />\nIn case you haven’t figured it out yet, the Date class relies heavily on the UTC date and time. In<br />\norder to indicate a particular time zone’s relationship to UTC, the Date class provides a method called<br />\ngetTimezoneOffset() . This method returns the number of minutes that the current time zone is ahead<br />\nor behind UTC. For instance, getTimezoneOffset() returns 300 for U.S. Eastern Daylight Saving Time,<br />\nwhich is 5 hours (or 300 minutes) behind UTC.<br />\nIt is possible to determine if a particular time zone makes use of daylight saving time by using the<br />\ngetTimezoneOffset() . To do this, create a date of January 1 of any year, and then create a date of July<br />\n1 in the same year. Then, compare the time zone offset. If the minutes aren’t equal, the time zone uses<br />\ndaylight saving time; if they are equal, the time zone doesn’t use daylight saving time.<br />\nvar d1 = new Date(2004, 0, 1);<br />\nvar d2 = new Date(2004, 6, 1);<br />\nvar bSupportsDaylightSavingTime = d1.getTimezoneOffset() != d2.getTimezoneOffset();<br />\nThe remaining methods of the Date class (listed in the following table) are simply used to set and get<br />\nparticular parts of a date value.<br />\nMethod Description<br />\ngetTime() Returns the milliseconds representation of the date.<br />\nsetTime(milliseconds) Sets the milliseconds representation of the date.<br />\ngetFullYear() Returns the year of the date, represented by four dig-<br />\nits (such as 2004 instead of just 04).<br />\ngetUTCFullYear() Returns the year of the UTC date, represented by four<br />\ndigits.<br />\nTable continued on following page<br />\n79<br />\nwww.it-ebooks.infoChapter 3<br />\nMethod Description<br />\nsetFullYear(year) Sets the year of the date, which must be given as a<br />\nfour-digit year.<br />\nsetUTCFullYear(year) Sets the year of the UTC date, which must be given as<br />\na four-digit year.<br />\ngetMonth() Returns the month of the date, represented by the<br />\nnumbers 0 (for January) through 11 (for December).<br />\ngetUTCMonth() Returns the month of the UTC date, represented<br />\nby the numbers 0 (for January) through 11 (for<br />\nDecember).<br />\nsetMonth(month) Sets the month of the date, which is any number 0 or<br />\ngreater. Numbers greater than 11 begin to add years.<br />\nsetUTCMonth(month) Sets the month of the UTC date, which is any number<br />\n0 or greater. Numbers greater than 11 begin to add<br />\nyears.<br />\ngetDate() Returns the date, which is the day of the month, of the<br />\ndate value.<br />\ngetUTCDate() Returns the date, which is the day of the month, of the<br />\nUTC date value.<br />\nsetDate(date) Sets the day of the month of the date.<br />\nsetUTCDate(date) Sets the day of the month of the UTC date.<br />\ngetDay() Returns the day of the week of the date.<br />\ngetUTCDay() Returns the day of the week of the UTC date.<br />\nsetDay(day) Sets the day of the week of the date.<br />\nsetUTCDay(day) Sets the day of the week of the UTC date.<br />\ngetHours() Returns the hours of the date time.<br />\ngetUTCHours() Returns the hours of the UTC date time.<br />\nsetHours(hours) Sets the hours of the date time.<br />\nsetUTCHours(hours) Sets the hours of the UTC date time.<br />\ngetMinutes() Returns the minutes of the date time.<br />\ngetUTCMinutes() Returns the minutes of the UTC date time.<br />\nsetMinutes(minutes) Sets the minutes of the date time.<br />\nsetUTCMinutes(minutes) Sets the minutes of the UTC date time.<br />\ngetSeconds() Returns the seconds of the date time.<br />\ngetUTCSeconds() Returns the seconds of the UTC date time.<br />\nsetSeconds(seconds) Sets the seconds of the date time.<br />\n80<br />\nwww.it-ebooks.infoObject Basics<br />\nMethod Description<br />\nsetUTCSeconds(seconds) Sets the seconds of the UTC date time.<br />\ngetMilliseconds() Returns the milliseconds of the date time. Note that<br />\nthis does not refer to the milliseconds since January 1,<br />\n1970, but rather the number of milliseconds in the cur-<br />\nrent time, such as 4:55:34.20, where 20 is the number<br />\nof milliseconds of the time.<br />\ngetUTCMilliseconds () Returns the milliseconds of the UTC date time.<br />\nsetMilliseconds (milliseconds) Sets the milliseconds of the date time.<br />\nsetUTCMilliseconds (millseconds) Sets the milliseconds of the UTC date time.<br />\nBuilt-in objects<br />\nECMA-262 defines a built-in object as “any object supplied by an ECMAScript implementation, indepen-<br />\ndent of the host environment, which is present at the start of the execution of an ECMAScript program.”<br />\nThis means the developer does not need to explicitly instantiate a built-in object; it is already instanti-<br />\nated. Only two built-in objects are defined by ECMA-262: Global and Math (which are also both native<br />\nobjects because by definition, every built-in object is a native object).<br />\nThe Global object<br />\nThe Global object is the most unique in ECMAScript because, for all in</p>\n', NULL, 'LMS Site , LMS Site2', 'LMS Site', 7, '2016-06-17 12:06:57', NULL);
INSERT INTO `Services` (`id`, `title`, `content`, `user_id`, `meta`, `slug`, `price`, `created_at`, `updated_at`) VALUES
(7, 'Company Site', '<p dir="ltr">Built-in objects<br />\nECMA-262 defines a built-in object as “any object supplied by an ECMAScript implementation, indepen-<br />\ndent of the host environment, which is present at the start of the execution of an ECMAScript program.”<br />\nThis means the developer does not need to explicitly instantiate a built-in object; it is already instanti-<br />\nated. Only two built-in objects are defined by ECMA-262: Global and Math (which are also both native<br />\nobjects because by definition, every built-in object is a native object).<br />\nThe Global object<br />\nThe Global object is the most unique in ECMAScript because, for all intents and purposes, it doesn’t<br />\nexist. If you try typing the following line, you get an error:<br />\nvar pointer = Global;<br />\nThe error would say that Global is not an object, but didn’t I just say that it is an object? Yes. The<br />\nmain concept to understand is this: In ECMAScript no standalone functions exist; all functions must<br />\nbe methods of some object to actually exist. So functions covered earlier in this book such as isNaN() ,<br />\nisFinite() , parseInt() , and parseFloat() only look like they are standalone functions. In reality,</p>\n\n<p dir="ltr"><img alt="" border="0" height="604" hspace="0" src="data:image/png;base64," style="width:801px;height:604px;margin-top:0px;margin-bottom:0px;margin-left:0px;margin-right:0px;border:0px solid black;" vspace="0" width="801" /><br />\nthey are all methods of the Global object. But these are not the only methods for the Global object.<br />\nThe encodeURI() and encodeURIComponent() methods are used to encode URIs (Uniform Resource<br />\nIdentifiers) to be passed to the browser. To be valid, a URI cannot contain certain characters, such as<br />\nspaces. These methods help to encode the URIs so that a browser can still accept and understand them,<br />\nreplacing all invalid characters with a special UTF-8 encoding.<br />\nThe encodeURI() method is designed to work on an entire URI (for instance, http://www.wrox.com/<br />\nillegal value.htm) , whereas encodeURIComponent() is designed to work solely on a segment of a<br />\nURI (such as illegal value.htm from the previous URI). The main difference between the two meth-<br />\nods is that encodeURI() does not encode special characters that are part of a URI such as the colon, for-<br />\nward slash, question mark, and pound sign; encodeURIComponent() encodes every non-standard<br />\ncharacter it finds. For example:<br />\nvar sUri = “http://www.wrox.com/illegal value.htm#start”;<br />\nalert(encodeURI(sUri));<br />\nalert(encodeURIComponent(sUri));<br />\n81<br />\nwww.it-ebooks.infoChapter 3<br />\nThis code outputs two values:<br />\nhttp://www.wrox.com/illegal%20value.htm#start<br />\nhttp%3A%2F%2Fwww.wrox.com%2Fillegal%20value.htm%23start<br />\nAs you can see, the first URI was left intact except for the space, which was replaced with %20 . The second<br />\nURI replaced all non-alphanumeric characters with their encoded equivalents, which essentially makes<br />\nthis URI useless. This is why encodeURI() can be used on full URIs, whereas encodeURIComponent()<br />\ncan only be used on strings that are appended to the end of an existing URI.<br />\nNaturally, there are also two methods to decode URIs that have already been encoded, called<br />\ndecodeURI() and decodeURIComponent() . As you might expect, these methods do the exact opposite<br />\nof their counterparts. The decodeURI() method only decodes characters that have been replaced by<br />\nusing encodeURI() . For instance %20 is replaced with a space, but %23 is not replaced because it repre-<br />\nsents a pound sign (#), which encodeURI() does not replace. Likewise, decodeURIComponent()<br />\ndecodes all characters encoded by encodeURIComponent() , essentially meaning it decodes all special<br />\nvalues. Example:<br />\nvar sUri = “http%3A%2F%2Fwww.wrox.com%2Fillegal%20value.htm%23start”;<br />\nalert(decodeURI(sUri));<br />\nalert(decodeURIComponent(sUri));<br />\nThis code outputs two values:<br />\nhttp%3A%2F%2Fwww.wrox.com%2Fillegal value.htm%23start<br />\nhttp://www.wrox.com/illegal value.htm#start<br />\nIn this example, the uri variable contains a string that is encoded using encodeURIComponent() . The<br />\nresulting values show what happens when you apply the two decoding methods. The first value is<br />\nthe output of decodeURI() , which replaced only %20 with a space; the second value is the output of<br />\ndecodeURIComponent() , which replaces all the special characters.<br />\nThese URI methods, encodeURI() , encodeURIComponent() , decodeURI() , and<br />\ndecodeURIComponent() , replace the BOM methods escape() and unescape() .<br />\nThe URI methods are always preferable because they encode all Unicode characters,<br />\nwhereas the BOM methods encode only ASCII characters correctly. Avoid using<br />\nescape() and unescape() .<br />\nThe final method is perhaps the most powerful in the entire ECMAScript language, the eval() method.<br />\nThis method works like an entire ECMAScript interpreter and accepts one argument, a string of<br />\nECMAScript (or JavaScript) to execute. For example:<br />\neval(“alert(‘hi’)”);<br />\nThis line is functionally equivalent to the following:<br />\nalert(“hi”);<br />\n82<br />\nwww.it-ebooks.infoObject Basics<br />\nWhen the interpreter finds an eval() call, it interprets the argument into actual ECMAScript statements<br />\nand then inserts it into place. This means that variables can be referenced inside of an eval() call that is<br />\ndefined outside of its argument:<br />\nvar msg = “hello world”;<br />\neval(“alert(msg)”);<br />\nHere, the variable msg is defined outside of the context of the eval() call, yet the alert is still displayed<br />\nwith the text “hello world” because the second line is replaced with a real line of code. Likewise, you<br />\ncan define a function or variables inside of an eval() call that can be referenced by the code outside of<br />\nitself:<br />\neval(“function sayHi() { alert(‘hi’); }”);<br />\nsayHi();<br />\nHere, the sayHi() function is defined inside of an eval() call. Because that call is replaced with the<br />\nactual function, it is possible to call sayHi() on the following line.<br />\nThis capability is very powerful, but also very dangerous. Use ext</p>\n', NULL, 'Company Site , Company Site T', 'Company Site', 6, '2016-06-17 12:22:36', NULL);
