(8, 'Kaleg Site', '<p dir="ltr">Host objects<br />\nAny object that is not native is considered to be a host object, which is defined as an object provided by<br />\nthe host environment of an ECMAScript implementation. All BOM and DOM objects are considered to<br />\nbe host objects and are discussed later in the book.<br />\n87<br />\nwww.it-ebooks.infoChapter 3<br />\nScope<br />\nProgrammers in any language understand the concept of scope, meaning the area in which certain vari-<br />\nables are accessible.<br />\nPublic, protected, and private<br />\nIn traditional object-oriented programming, a lot of focus is placed on the public and private scopes. An<br />\nobject’s properties in the public scope can be accessed from outside the object, meaning that after a devel-<br />\noper creates an instance of the object, that property can be used. Properties in the private scope, however,<br />\ncan only be accessed from within the object itself, meaning that these properties don’t exist to the out-<br />\nside world. This also means that subclasses of the class defining the private properties and methods<br />\ncan’t access them either.<br />\nMore recently, another scope has become popular: protected. Although different languages have different<br />\nrules for the protected scope, it generally is used to define properties and methods that act private except<br />\nthat they are accessible by subclasses.<br />\nThe discussion of these scopes in reference to ECMAScript is almost a moot point because only one<br />\nscope of these three exists: the public scope. All properties and methods of all objects in ECMAScript are<br />\npublic. You must take great care, therefore, when defining your own classes and objects. Keep in mind<br />\nthat all properties and methods are public by default.<br />\nThis problem has been tackled by many developers online trying to come up with effective property<br />\nscoping schemes. Due to the lack of a private scope, a convention was developed to indicate which prop-<br />\nerties and methods should be considered private. This convention involves adding two underscores<br />\nbefore and after the actual property name. For example:<br />\nobj.__color__ = “red”;<br />\nIn this code, the color property is intended to be private. Remember, adding these underscores doesn’t<br />\nchange the fact that the property is public; it just indicates to other developers that it should be consid-<br />\nered private.<br />\nSome developers also prefer to use a single underscore to indicate private members, such as<br />\nobj._color .<br />\nStatic is not static<br />\nThe static scope defines properties and methods accessible all the time from one location. In Java, classes<br />\ncan have static properties and methods that are accessible without instantiating an object of that class,<br />\nsuch as java.net.URLEncoder , whose function encode() is a static method.<br />\nStrictly speaking, ECMAScript doesn’t have a static scope. It can, however, provide properties and meth-<br />\nods on constructors. Remember, constructors are just functions. Functions are objects, and objects can<br />\nhave properties and methods. For instance:<br />\nfunction sayHi() {<br />\nalert(“hi”);<br />\n}<br />\n88<br />\nwww.it-ebooks.infoObject Basics<br />\nsayHi.alternate = function() {<br />\nalert(“hola”);<br />\n};<br />\nsayHi();<br />\nsayHi.alternate();<br />\n//outputs “hi”<br />\n//outputs “hola”<br />\nHere, the method alternate() is actually a method on the function sayHi . It is possible to call the<br />\nsayHi() as a regular function to output “hi” as well as calling sayHi.alternate() to output “hola” .<br />\nEven so, alternate() is considered to be a method of the function sayHi() in the public scope, not a<br />\nstatic method.<br />\nThe this keyword<br />\nOne of the most important concepts to grasp in ECMAScript is the use of the this keyword, which is<br />\nused in object methods. The this keyword always points to the object that is calling a particular<br />\nmethod, for example:<br />\nvar oCar = new Object;<br />\noCar.color = “red”;<br />\noCar.showColor = function () {<br />\nalert(this.color);<br />\n//outputs “red”<br />\n};<br />\nHere, the this keyword is used in the showColor() method of an object. In this context, this is equal<br />\nto car , making this code functionality equivalent to the following:</p>\n\n<p dir="ltr"><img alt="" border="0" height="455" hspace="0" src="data:image/jpeg;base64," style="width:1098px;height:455px;margin-top:0px;margin-bottom:0px;margin-left:0px;margin-right:0px;border:0px solid black;" vspace="0" width="1098" /><br />\nvar oCar = new Object;<br />\noCar.color = “red”;<br />\noCar.showColor = function () {<br />\nalert(oCar.color);<br />\n//outputs “red”<br />\n};<br />\nSo why use this ? Because you can never be sure of the variable name a developer will use when instan-<br />\ntiating an object. By using this , it is possible to reuse the same function in any number of different<br />\nplaces. Consider the following example:<br />\nfunction showColor() {<br />\nalert(this.color);<br />\n}<br />\nvar oCar1 = new Object;<br />\noCar1.color = “red”;<br />\noCar1.showColor = showColor;<br />\nvar oCar2 = new Object;<br />\noCar2.color = “blue”;<br />\noCar2.showColor = showColor;<br />\noCar1.showColor();<br />\noCar2.showColor();<br />\n//outputs “red”<br />\n//outputs “blue”<br />\n89<br />\nwww.it-ebooks.infoChapter 3<br />\nIn this code, the function showColor() is defined first (using this ). Then, two objects ( oCar1 and<br />\noCar2 ) are created, one with a color property set to “red” , and the other with a color property set<br />\nto “blue” . Both objects are assigned a property called showColor that points to the original function<br />\nnamed showColor() (note that no naming problem exists because one is a global function and the other<br />\nis a property of an object). When calling showColor() on each object, the oCar1 outputs “red” whereas<br />\noCar2 outputs “blue” . This happens because the this keyword in the function is equal to car1 when<br />\noCar1.showColor() is called and equal to oCar2 when oCar2.showColor() is called.<br />\nNote that the this keyword must be used when referring to properties of an object. For instance,<br />\nshowColor() wouldn’t work if it were written like this:<br />\nfunction showColor() {<br />\nalert(color);<br />\n}<br />\nWhenever a variable is referenced</p>\n', NULL, 'Kaleg Site , Kaleg Site', 'Kaleg Site', 5, '2016-06-17 12:24:28', NULL);
